B.X5=new A.hn('\uc81c1\uc870 \ubaa9\uc801\n\n\uc774 \uc57d\uad00\uc740 \ub098\ucef4\ud37c\ub2c8 (\uc774\ud558 \'\ud68c\uc0ac\')\uac00 \uc6b4\uc601\ud558\ub294 \uc778\ud130\ub137 \uad00\ub828 \uc11c\ube44\uc2a4(\uc774\ud558 \'\uc11c\ube44\uc2a4\')\ub97c \ud558\ub098\uc758 \ud68c\uc6d0 \uc544\uc774\ub514\uc640 \ube44\ubc00\ubc88\ud638\ub85c \ub3d9\uc2dc\uc5d0 \uac01 \uc0ac\uc774\ud2b8\uc5d0 \uac00\uc785\ud558\uc5ec \uc774\uc6a9\ud568\uc5d0 \uc788\uc5b4 \ud68c\uc0ac\uc640 \uc774\uc6a9\uc790\uc758 \uad8c\ub9ac, \uc758\ubb34 \ubc0f \ucc45\uc784\uc0ac\ud56d\uc744 \uaddc\uc815\ud568\uc744 \ubaa9\uc801\uc73c\ub85c \ud569\ub2c8\ub2e4.\n\n\uc81c2\uc870 \uc6a9\uc5b4\uc758 \uc815\uc758\n\n\uc774 \uc57d\uad00\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 \uc6a9\uc5b4\uc758 \uc815\uc758\ub294 \ub2e4\uc74c\uacfc \uac19\uc2b5\ub2c8\ub2e4. \ubcf8 \uc57d\uad00\uc5d0 \uba85\uc2dc\ub418\uc9c0 \uc54a\uc740 \uc6a9\uc5b4\ub294 \uad00\ub828 \ubc95\ub839\uc774 \uc815\ud558\ub294 \ubc14\uc5d0 \ub530\ub974\uba70, \uadf8 \uc678\uc5d0\ub294 \uc77c\ubc18\uc801\uc778 \uc0c1\uac70\ub798\uad00\ud589\uc5d0 \uc758\ud569\ub2c8\ub2e4.\n\n(1) \ud68c\uc0ac\n\n\ub098\ucef4\ud37c\ub2c8\ub97c \ub9d0\ud569\ub2c8\ub2e4.\n\n(2) \uc571\n\n\uc2a4\ub9c8\ud2b8\ud3f0, \ud0dc\ube14\ub9bf \ub4f1 \ud734\ub300\uc6a9 \ub2e8\ub9d0\uae30\uc5d0 \uc124\uce58\ub418\uc5b4 \ud68c\uc0ac\uac00 \uc81c\uacf5\ud558\ub294 \uc11c\ube44\uc2a4\ub97c \uad6c\ud604\ud558\ub294 \uc560\ud50c\ub9ac\ucf00\uc774\uc158\uc744 \ub9d0\ud569\ub2c8\ub2e4.\n\n(3) \ud68c\uc6d0\n\n\ud68c\uc0ac\uc5d0 \uac1c\uc778\uc815\ubcf4\ub97c \uc81c\uacf5\ud558\uc5ec \ud68c\uc6d0\ub4f1\ub85d\uc744 \ud55c \uc790\ub85c\uc11c \uc774 \uc57d\uad00\uc5d0 \ub530\ub77c \ud68c\uc0ac\uc640 \uc11c\ube44\uc2a4\uc774\uc6a9\uacc4\uc57d\uc744\n\uccb4\uacb0\ud55c \uc790\ub97c \ub9d0\ud569\ub2c8\ub2e4.\n\n(4) ID\n\n\ud68c\uc6d0\uc758 \uc2dd\ubcc4\uacfc \uc11c\ube44\uc2a4 \uc774\uc6a9\uc744 \uc704\ud558\uc5ec \ud68c\uc6d0\uc774 \uc120\uc815\ud558\uace0 \ud68c\uc0ac\uac00 \uc2b9\uc778\ud55c \uc774\uba54\uc77c\uc744 \ub9d0\ud569\ub2c8\ub2e4.\n\n(5) \ube44\ubc00\ubc88\ud638\n\n\ud68c\uc6d0\uc758 \ub3d9\uc77c\uc131 \ud655\uc778\uacfc \ud68c\uc6d0\uc758 \uad8c\uc775 \ubc0f \ube44\ubc00\ubcf4\ud638\ub97c \uc704\ud558\uc5ec \ud68c\uc6d0 \uc2a4\uc2a4\ub85c\uac00 \uc124\uc815\ud558\uc5ec \ud68c\uc0ac\uc5d0 \ub4f1\ub85d\ud55c \uc601\ubb38 \ub610\ub294 \uc22b\uc790\uc758 \uc870\ud569\uc744 \ub9d0\ud569\ub2c8\ub2e4.\n\n(6) \ucf58\ud150\uce20\n\n\ud68c\uc0ac\uac00 \uc81c\uacf5\ud558\ub294 \ub514\uc9c0\ud138 \ucf58\ud150\uce20 \ubc0f \uae30\ud0c0 \uad00\ub828 \uc815\ubcf4(\ubd80\ud638, \ubb38\uc790, \uc74c\uc131, \uc74c\ud5a5, \uc774\ubbf8\uc9c0, \uc601\uc0c1 \ub4f1\uc73c\ub85c \ud45c\ud604\ub41c \uc790\ub8cc \ub610\ub294 \uc815\ubcf4)\ub97c \ub9d0\ud569\ub2c8\ub2e4.\n\n\n\n\n(7) \uc138\uacc4\n\n\ud68c\uc6d0\uc774 \ucf58\ud150\uce20(\ubd80\ud638, \ubb38\uc790, \uc74c\uc131, \uc74c\ud5a5, \uc774\ubbf8\uc9c0, \uc601\uc0c1 \ub4f1\uc73c\ub85c \ud45c\ud604\ub41c \uc790\ub8cc \ub610\ub294 \uc815\ubcf4)\ub97c \uc62c\ub9b4 \uc218 \uc788\ub294 \uac8c\uc2dc\ud310\uc744 \ub9d0\ud569\ub2c8\ub2e4.\n\n(8) T-LOG\n\n\ud68c\uc6d0\uc774 \uac8c\uc2dc\ud558\ub294 \ucf58\ud150\uce20(\ubb38\uc790, \uc74c\ud5a5, \uc774\ubbf8\uc9c0)\ub97c \ub9d0\ud569\ub2c8\ub2e4.\n\n(9) \uad6c\ub974\ubc0d \ud3ec\uc778\ud2b8\n\n\ud68c\uc6d0\uc758 \uc720\ub8cc\ucf58\ud150\uce20 \uad6c\ub9e4\ub97c \uc704\ud55c \uac00\uc0c1\uc758 \ud654\ud3d0\uc785\ub2c8\ub2e4.\n\n(10) \uc544\uc774\ud15c\n\n\ud310\ub9e4\ub97c \ubaa9\uc801\uc73c\ub85c \uc62c\ub9ac\ub294 \ucf58\ud150\uce20(\uc77c\ub7ec\uc2a4\ud2b8, \uc5ed\ud560 \ud15c\ud50c\ub9bf, \uc138\uacc4 \ud15c\ud50c\ub9bf \ub4f1)\ub97c \ub9d0\ud569\ub2c8\ub2e4.\n\n(11) \uac24\ub7ec\ub9ac(\uac24\ub7ec\ub9ac)\n\n\uc544\uc774\ud15c\uc744 \uad6c\ub9e4/\ud310\ub9e4\ud560 \uc218 \uc788\ub294 \uac8c\uc2dc\ud310\uc785\ub2c8\ub2e4.\n\n(12) \uafc8\n\n\ud0c0 \uc138\uacc4\uc758 \uc644\uacb0\ub41c T-LOG\ub97c \uc720\ub8cc\ud654\ud558\uc5ec \ud310\ub9e4\ud558\ub294 \ucf58\ud150\uce20\ub97c \ub9d0\ud569\ub2c8\ub2e4.\n\n(13) \ud1a0\ud070\n\n\ud68c\uc0ac\uc5d0\uc11c \uc81c\uacf5\ud558\ub294 \uc2e4\uc81c \ud654\ud3d0\ub85c, \ud68c\uc6d0\uc758 \ud2b9\uc815\ud55c \ud65c\ub3d9\uc744 \ud1b5\ud574 \uc5bb\uc744 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n\n\n\uc81c3\uc870 \uc57d\uad00\uc758 \uba85\uc2dc\uc640 \uac1c\uc815\n\n(1) \ud68c\uc0ac\ub294 \uc774 \uc57d\uad00\uc758 \ub0b4\uc6a9\uacfc \uc0c1\ud638, \uc601\uc5c5\uc18c \uc18c\uc7ac\uc9c0, \ub300\ud45c\uc790\uc758 \uc131\uba85, \uc0ac\uc5c5\uc790 \ub4f1\ub85d\ubc88\ud638 \ub4f1\uc744 \uc774\uc6a9\uc790\uac00 \uc54c \uc218 \uc788\ub3c4\ub85d \uc0ac\uc774\ud2b8\uc758 \ucd08\uae30 \uc11c\ube44\uc2a4 \ud654\uba74\uc5d0 \uac8c\uc2dc\ud569\ub2c8\ub2e4. \ub2e4\ub9cc, \uc57d\uad00\uc758 \uad6c\uccb4\uc801 \ub0b4\uc6a9\uc740 \uc774\uc6a9\uc790\uac00 \uc5f0\uacb0\ud654\uba74\uc744 \ud1b5\ud558\uc5ec \ubcfc \uc218 \uc788\ub3c4\ub85d \ud569\ub2c8\ub2e4.\n(2) \ud68c\uc0ac\ub294 \uc57d\uad00\uc758 \uaddc\uc81c\uc5d0 \uad00\ud55c \ubc95\ub960, \ucf58\ud150\uce20\uc0b0\uc5c5 \uc9c4\ud765\ubc95, \uc804\uc790\ubb38\uc11c \ubc0f \uc804\uc790\uac70\ub798 \uae30\ubcf8\ubc95, \uc804\uc790\uc11c\uba85\ubc95, \uc815\ubcf4\ud1b5\uc2e0\ub9dd \uc774\uc6a9\ucd09\uc9c4 \ubc0f \uc815\ubcf4\ubcf4\ud638 \ub4f1\uc5d0 \uad00\ud55c \ubc95\ub960, \uc804\uc790\uc0c1\uac70\ub798 \ub4f1\uc5d0\uc11c\uc758 \uc18c\ube44\uc790\ubcf4\ud638\uc5d0 \uad00\ud55c \ubc95\ub960, \uc720\uc0ac\uc218\uc2e0\ud589\uc704\uc758 \uaddc\uc81c\uc5d0 \uad00\ud55c \ubc95\ub960 \ub4f1 \uad00\ub828\ubc95\uc744 \uc704\ubc30\ud558\uc9c0 \uc54a\ub294 \ubc94\uc704\uc5d0\uc11c \uc774 \uc57d\uad00\uc744 \uac1c\uc815\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n(3) \ud68c\uc0ac\uac00 \uc57d\uad00\uc744 \uac1c\uc815\ud560 \uacbd\uc6b0\uc5d0\ub294 \uc801\uc6a9\uc77c\uc790 \ubc0f \uac1c\uc815\uc0ac\uc720\ub97c \uba85\uc2dc\ud558\uc5ec \ud604\ud589 \uc57d\uad00\uacfc \ud568\uaed8 \uc0ac\uc774\ud2b8\uc758 \ucd08\uae30\ud654\uba74\uc5d0 \ucd5c\uc18c \uadf8 \uc801\uc6a9\uc77c\uc790 7\uc77c \uc774\uc804\ubd80\ud130 \uc801\uc6a9\uc77c\uc790 \uc804\uc77c\uae4c\uc9c0 \uacf5\uc9c0\ud569\ub2c8\ub2e4. \ub2e4\ub9cc, \uc774\uc6a9\uc790\uc5d0\uac8c \ubd88\ub9ac\ud558\uac8c \uc57d\uad00\uc758 \ub0b4\uc6a9\uc744 \ubcc0\uacbd\ud558\ub294 \uacbd\uc6b0\uc5d0\ub294 \uc801\uc6a9\uc77c\uc790 30\uc77c \uc774\uc804\ubd80\ud130 \uacf5\uc9c0\ud569\ub2c8\ub2e4.\n(4) \uc81c3\ud56d\uc5d0 \ub530\ub77c \uacf5\uc9c0\ub41c \uc801\uc6a9\uc77c\uc790 \uc774\ud6c4\uc5d0 \ud68c\uc6d0\uc774 \ud68c\uc0ac\uc758 \uc11c\ube44\uc2a4\ub97c \uacc4\uc18d \uc774\uc6a9\ud558\ub294 \uacbd\uc6b0\uc5d0\ub294 \uac1c\uc815\ub41c \uc57d\uad00\uc5d0 \ub3d9\uc758\ud558\ub294 \uac83\uc73c\ub85c \ubd05\ub2c8\ub2e4. \uac1c\uc815\ub41c \uc57d\uad00\uc5d0 \ub3d9\uc758\ud558\uc9c0 \uc544\ub2c8\ud558\ub294 \ud68c\uc6d0\uc740 \uc5b8\uc81c\ub4e0\uc9c0 \uc790\uc720\ub86d\uac8c \uc11c\ube44\uc2a4 \uc774\uc6a9\uacc4\uc57d\uc744 \ud574\uc9c0\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n(5) \uc774 \uc57d\uad00\uc5d0\uc11c \uc815\ud558\uc9c0 \uc544\ub2c8\ud55c \uc0ac\ud56d\uacfc \uc774 \uc57d\uad00\uc758 \ud574\uc11d\uc5d0 \uad00\ud558\uc5ec\ub294 \uc815\ubd80\uac00 \uc81c\uc815\ud55c \uc804\uc790\uac70\ub798\uc18c\ube44\uc790\ubcf4\ud638\uc9c0\uce68 \ubc0f \uad00\uacc4\ubc95\ub839 \ub610\ub294 \uc77c\ubc18 \uc0c1 \uad00\ub840\uc5d0 \ub530\ub985\ub2c8\ub2e4.\n\n\uc81c4\uc870 \uc774\uc6a9\uacc4\uc57d\uc758 \uc131\ub9bd\n\n(1) \uc774\uc6a9\uacc4\uc57d\uc740 \uc774\uc6a9\uc790\uc758 \uc57d\uad00\ub3d9\uc758\uc640 \uc774\uc6a9\uc2e0\uccad\uc5d0 \ub300\ud55c \ud68c\uc0ac\uc758 \uc2b9\ub099\uc73c\ub85c \uc131\ub9bd\ud569\ub2c8\ub2e4.\n(2) \uc774\uc6a9\uacc4\uc57d\uc758 \uc131\ub9bd\uc2dc\uae30\ub294 \ud68c\uc0ac\uac00 \uac00\uc785\uc644\ub8cc \ud45c\uc2dc\ub97c \uc2e0\uccad\uc808\ucc28 \uc0c1\uc5d0 \ud45c\uc2dc\ud55c \uc2dc\uc810\uc73c\ub85c \ud569\ub2c8\ub2e4.\n\n\n\uc81c5\uc870 \uacc4\uc57d\uc0ac\ud56d\uc758 \ubcc0\uacbd\n\n(1) \ud68c\uc6d0\uc740 \ud68c\uc6d0\uc815\ubcf4\uad00\ub9ac\ub97c \ud1b5\ud574 \uc5b8\uc81c\ub4e0\uc9c0 \uc790\uc2e0\uc758 \uc815\ubcf4\ub97c \uc5f4\ub78c\ud558\uace0, \uc218\uc815\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n\uc81c6\uc870 \uc774\uc6a9\uc790\uc758 \uc815\ubcf4 \ubcf4\uc548\n\n(1) \ud68c\uc0ac \uc11c\ube44\uc2a4 \uac00\uc785\uc808\ucc28\ub97c \uc644\ub8cc\ud558\ub294 \uc21c\uac04\ubd80\ud130 \ud68c\uc6d0\uc740 \uc785\ub825\ud55c \uc815\ubcf4\uc758 \ube44\ubc00\uc744 \uc720\uc9c0\ud560 \ucc45\uc784\uc774 \uc788\uc73c\uba70 ID\uc640 \ube44\ubc00\ubc88\ud638\ub97c \uc0ac\uc6a9\ud558\uc5ec \ubc1c\uc0dd\ud558\ub294 \ubaa8\ub4e0 \uacb0\uacfc\uc5d0 \ub300\ud55c \ucc45\uc784\ub3c4 \ud68c\uc6d0\uc5d0\uac8c \uc788\uc2b5\ub2c8\ub2e4.\n(2) ID\uc640 \ube44\ubc00\ubc88\ud638\uc5d0 \uad00\ud55c \ubaa8\ub4e0 \uad00\ub9ac\uc758 \ucc45\uc784\uc740 \ud68c\uc6d0\uc5d0\uac8c \uc788\uc73c\uba70, ID \ub098 \ube44\ubc00\ubc88\ud638\uac00 \ubd80\uc815\ud558\uac8c \uc0ac\uc6a9\ub418\uc5c8\ub2e4\ub294 \uc0ac\uc2e4\uc744 \ubc1c\uacac\ud55c \uacbd\uc6b0\uc5d0\ub294 \uc989\uc2dc \ud68c\uc0ac\uc5d0 \ud1b5\uc9c0\ud558\uc5ec\uc57c \ud569\ub2c8\ub2e4. \ud1b5\uc9c0\ud558\uc9c0 \uc54a\uc74c\uc73c\ub85c \uc778\ud574 \ubc1c\uc0dd\ud558\ub294 \ubaa8\ub4e0 \ucc45\uc784\uc740 \ud68c\uc6d0\uc5d0\uac8c \uc788\uc2b5\ub2c8\ub2e4.\n(3) \uc774\uc6a9\uc790\ub294 \ud68c\uc0ac \uc11c\ube44\uc2a4\uc758 \uc0ac\uc6a9 \uc885\ub8cc \uc2dc\ub9c8\ub2e4 \uc815\ud655\ud788 \ub85c\uadf8\uc544\uc6c3(Log-out)\ud574\uc57c \ud558\uba70, \ub85c\uadf8\uc544\uc6c3 \ud558\uc9c0 \uc544\ub2c8\ud558\uc5ec \uc81c3\uc790\uac00 \ud68c\uc6d0\uc5d0 \uad00\ud55c \uc815\ubcf4\ub97c \ub3c4\uc6a9\ud558\ub294 \ub4f1\uc758 \uacb0\uacfc\ub85c \uc778\ud574 \ubc1c\uc0dd\ud558\ub294 \uc190\ud574 \ubc0f \uc190\uc2e4\uc5d0 \ub300\ud558\uc5ec \ud68c\uc0ac\ub294 \ucc45\uc784\uc744 \ubd80\ub2f4\ud558\uc9c0 \uc544\ub2c8\ud569\ub2c8\ub2e4.\n\n\uc81c7\uc870 \uc11c\ube44\uc2a4 \uc774\uc6a9\n\n(1) \ud68c\uc0ac\ub294 \ud68c\uc6d0\uc5d0\uac8c \uc544\ub798\uc640 \uac19\uc740 \uc11c\ube44\uc2a4\ub97c \uc81c\uacf5\ud569\ub2c8\ub2e4.\n- \ucf58\ud150\uce20 \ud310\ub9e4 \ubc0f \ubc1c\ud589 \uc11c\ube44\uc2a4\n- \ucf58\ud150\uce20 \ucd94\ucc9c \ubc0f \uc54c\ub9bc \uc11c\ube44\uc2a4\n- \ucf58\ud150\uce20\ub97c \ud1b5\ud55c \uc218\uc775\ucc3d\ucd9c \uc11c\ube44\uc2a4\n- \ud310\ub9e4/\uad6c\ub9e4 \uc11c\ube44\uc2a4\n- \uae30\ud0c0 \ud68c\uc0ac\uac00 \ucd94\uac00 \uac1c\ubc1c\ud558\uac70\ub098 \ub2e4\ub978 \ud68c\uc0ac\uc640\uc758 \uc81c\ud734\uacc4\uc57d \ub4f1\uc744 \ud1b5\ud574 \ud68c\uc6d0\uc5d0\uac8c \uc81c\uacf5\ud558\ub294 \uc77c\uccb4\uc758 \uc11c\ube44\uc2a4\n\n(2) \ud68c\uc6d0\uc740 \ud68c\uc6d0\uac00\uc785\uc774 \uc644\ub8cc\ub41c \uc2dc\uc810\ubd80\ud130 \uc11c\ube44\uc2a4\ub97c \uc774\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n(3) \ud68c\uc0ac\uc758 \uc5c5\ubb34\uc0c1 \ub610\ub294 \uae30\uc220\uc0c1\uc758 \uc7a5\uc560\ub85c \uc778\ud558\uc5ec \uc11c\ube44\uc2a4\uc758 \uc774\uc6a9\uc744 \uac1c\uc2dc\ud558\uc9c0 \ubabb\ud558\ub294 \uacbd\uc6b0\uc5d0\ub294 \uc0ac\uc774\ud2b8\uc5d0 \uacf5\uc2dc\ud558\uac70\ub098 \ud68c\uc6d0\uc5d0\uac8c \uc774\ub97c \ud1b5\uc9c0\ud569\ub2c8\ub2e4.\n(4) \uc11c\ube44\uc2a4\uc758 \uc774\uc6a9\uc740 \uc5f0\uc911\ubb34\ud734, 1\uc77c 24\uc2dc\uac04\uc744 \uc6d0\uce59\uc73c\ub85c \ud569\ub2c8\ub2e4. \ub2e4\ub9cc, \ud68c\uc0ac\uc758 \uc5c5\ubb34\uc0c1 \ub610\ub294 \uae30\uc220\uc0c1\uc758 \uc774\uc720\ub85c \uc11c\ube44\uc2a4\uac00 \uc77c\uc2dc \uc911\uc9c0 \ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc774\ub7ec\ud55c \uacbd\uc6b0 \ud68c\uc0ac\ub294 \uc0ac\uc804 \ub610\ub294 \uc0ac\ud6c4\uc5d0 \uc774\ub97c \uacf5\uc9c0\ud569\ub2c8\ub2e4.\n(5)\ud68c\uc0ac\ub294 \uc11c\ube44\uc2a4\ub97c \uc77c\uc815\ubc94\uc704\ub85c \ubd84\ud560\ud558\uc5ec \uac01 \ubc94\uc704 \ubcc4\ub85c \uc774\uc6a9\uac00\ub2a5 \uc2dc\uac04\uc744 \ubcc4\ub3c4\ub85c \uc815\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc774 \uacbd\uc6b0 \uadf8 \ub0b4\uc6a9\uc744 \uc0ac\uc804\uc5d0 \uacf5\uac1c\ud569\ub2c8\ub2e4.\n\n\n\uc81c8\uc870 \uc11c\ube44\uc2a4\uc758 \uc911\uc9c0 \ubc0f \uc911\uc9c0\uc5d0 \ub300\ud55c \uacf5\uc9c0\n\n(1) \ud68c\uc6d0\uc740 \ud68c\uc0ac \uc11c\ube44\uc2a4\uc5d0 \ubcf4\uad00\ub418\uac70\ub098 \uc804\uc1a1\ub41c \uba54\uc2dc\uc9c0 \ubc0f \uae30\ud0c0 \ud1b5\uc2e0 \uba54\uc2dc\uc9c0 \ub4f1\uc758 \ub0b4\uc6a9\uc774 \uad6d\uac00\uc758 \ube44\uc0c1\uc0ac\ud0dc, \uc815\uc804, \ud68c\uc0ac \uad00\ub9ac\ubc94\uc704 \uc678\uc758 \uc11c\ube44\uc2a4 \uc124\ube44 \uc7a5\uc560 \ubc0f \uae30\ud0c0 \ubd88\uac00\ud56d\ub825\uc5d0 \uc758\ud558\uc5ec \ubcf4\uad00\ub418\uc9c0 \ubabb\ud558\uc600\uac70\ub098 \uc0ad\uc81c\ub41c \uacbd\uc6b0, \uc804\uc1a1\ub418\uc9c0 \ubabb\ud55c \uacbd\uc6b0 \ubc0f \uae30\ud0c0 \ud1b5\uc2e0 \ub370\uc774\ud130\uc758 \uc190\uc2e4\uc5d0 \ub300\ud574 \ud68c\uc0ac\ub294 \uad00\ub828 \ucc45\uc784\uc744 \ubd80\ub2f4\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\n(2) \ud68c\uc0ac\uac00 \uc815\uc0c1\uc801\uc778 \uc11c\ube44\uc2a4 \uc81c\uacf5\uc758 \uc5b4\ub824\uc6c0\uc73c\ub85c \uc778\ud558\uc5ec \uc77c\uc2dc\uc801\uc73c\ub85c \uc11c\ube44\uc2a4\ub97c \uc911\uc9c0\ud558\uc5ec\uc57c \ud560 \uacbd\uc6b0\uc5d0\ub294 \uc11c\ube44\uc2a4 \uc911\uc9c0 1\uc8fc\uc77c \uc804\uc5d0 \uace0\uc9c0 \ud6c4 \uc11c\ube44\uc2a4\ub97c \uc911\uc9c0\ud560 \uc218 \uc788\uc73c\uba70, \uc774 \uae30\uac04 \ub3d9\uc548 \ud68c\uc6d0\uc774 \uace0\uc9c0\ub0b4\uc6a9\uc744 \uc778\uc9c0\ud558\uc9c0 \ubabb\ud55c \uac83\uc5d0 \ub300\ud558\uc5ec \ud68c\uc0ac\ub294 \ucc45\uc784\uc744 \ubd80\ub2f4\ud558\uc9c0 \uc544\ub2c8\ud569\ub2c8\ub2e4. \uc0c1\ub2f9\ud55c \uc774\uc720\uac00 \uc788\uc744 \uacbd\uc6b0 \uc704 \uc0ac\uc804 \uace0\uc9c0\uae30\uac04\uc740 \uac10\ucd95\ub418\uac70\ub098 \uc0dd\ub7b5\ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ub610\ud55c \uc704 \uc11c\ube44\uc2a4 \uc911\uc9c0\uc5d0 \uc758\ud558\uc5ec \ubcf8 \uc11c\ube44\uc2a4\uc5d0 \ubcf4\uad00\ub418\uac70\ub098 \uc804\uc1a1\ub41c \uba54\uc2dc\uc9c0 \ubc0f \uae30\ud0c0 \ud1b5\uc2e0 \uba54\uc2dc\uc9c0 \ub4f1\uc758 \ub0b4\uc6a9\uc774 \ubcf4\uad00\ub418\uc9c0 \ubabb\ud558\uc600\uac70\ub098 \uc0ad\uc81c\ub41c \uacbd\uc6b0, \uc804\uc1a1\ub418\uc9c0 \ubabb\ud55c \uacbd\uc6b0 \ubc0f \uae30\ud0c0 \ud1b5\uc2e0 \ub370\uc774\ud130\uc758 \uc190\uc2e4\uc774 \uc788\uc744 \uacbd\uc6b0\uc5d0 \ub300\ud558\uc5ec\ub3c4 \ud68c\uc0ac\ub294 \ucc45\uc784\uc744 \ubd80\ub2f4\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\n(3) \ud68c\uc0ac\uc758 \uc0ac\uc815\uc73c\ub85c \uc11c\ube44\uc2a4\ub97c \uc601\uad6c\uc801\uc73c\ub85c \uc911\ub2e8\ud558\uc5ec\uc57c \ud560 \uacbd\uc6b0\uc5d0 \uc81c 2 \ud56d\uc744 \uc900\uc6a9\ud569\ub2c8\ub2e4. \ub2e4\ub9cc \uc774 \uacbd\uc6b0 \uc0ac\uc804 \uace0\uc9c0\uae30\uac04\uc740 1\uac1c\uc6d4\ub85c \ud569\ub2c8\ub2e4.\n(4) \ucc9c\uc7ac\uc9c0\ubcc0, \uad6d\uac00\ube44\uc0c1\uc0ac\ud0dc \ub4f1 \ud68c\uc0ac\uac00 \uc815\uc0c1\uc801\uc778 \uc11c\ube44\uc2a4 \uc81c\uacf5\uc774 \ubd88\uac00\ub2a5\ud560 \uacbd\uc6b0 \uc77c\uc2dc\uc801\uc73c\ub85c \uc11c\ube44\uc2a4\ub97c \uc81c\ud55c, \uc815\uc9c0\uc2dc\ud0ac \uc218 \uc788\uc73c\uba70 \uc0ac\uc804 \ub610\ub294 \uc0ac\ud6c4 \ud68c\uc6d0\uc5d0\uac8c \uc911\uc9c0\uc0ac\uc720 \ubc0f \uae30\uac04\uc744 \uacf5\uc9c0\ud569\ub2c8\ub2e4.\n(5) \ud68c\uc0ac\ub294 \uc0ac\uc804 \uacf5\uc9c0 \ud6c4 \uc11c\ube44\uc2a4\ub97c \uc77c\uc2dc\uc801\uc73c\ub85c \uc218\uc815, \ubcc0\uacbd \ubc0f \uc911\ub2e8\ud560 \uc218 \uc788\uc73c\uba70, \uc0c1\ub2f9\ud55c \uc774\uc720\uac00 \uc788\uc744 \uacbd\uc6b0 \uc704 \uc0ac\uc804 \uacf5\uc9c0\ub294 \uc0dd\ub7b5\ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ud68c\uc0ac\ub294 \uc704 \uc218\uc815, \ubcc0\uacbd \ubc0f \uc911\ub2e8\uc5d0 \ub300\ud558\uc5ec \ud68c\uc6d0 \ub610\ub294 \uc81c 3\uc790\uc5d0 \uc5b4\ub5a0\ud55c \ucc45\uc784\ub3c4 \ubd80\ub2f4\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\n(6) \ud68c\uc0ac\ub294 \uae34\uae09\ud55c \uc2dc\uc2a4\ud15c \uc810\uac80, \uc99d\uc124 \ubc0f \uad50\uccb4 \ub4f1 \ubd80\ub4dd\uc774\ud55c \uc0ac\uc720\ub85c \uc778\ud558\uc5ec \uc608\uace0 \uc5c6\uc774 \uc77c\uc2dc\uc801\uc73c\ub85c \uc11c\ube44\uc2a4\ub97c \uc911\ub2e8\ud560 \uc218 \uc788\uc73c\uba70, \uc0c8\ub85c\uc6b4 \uc11c\ube44\uc2a4\ub85c\uc758 \uad50\uccb4 \ub4f1 \ud68c\uc0ac\uac00 \uc801\uc808\ud558\ub2e4\uace0 \ud310\ub2e8\ud558\ub294 \uc0ac\uc720\uc5d0 \uc758\ud558\uc5ec \ud604\uc7ac \uc81c\uacf5\ub418\ub294 \uc11c\ube44\uc2a4\ub97c \uc644\uc804\ud788 \uc911\ub2e8\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n(7) \ud68c\uc0ac\uac00 \ud1b5\uc81c\ud560 \uc218 \uc5c6\ub294 \uc0ac\uc720\ub85c \uc778\ud55c \uc11c\ube44\uc2a4 \uc911\ub2e8\uc758 \uacbd\uc6b0(\uc2dc\uc2a4\ud15c\uad00\ub9ac\uc790\uc758 \uace0\uc758, \uacfc\uc2e4 \uc5c6\ub294 \ub514\uc2a4\ud06c \uc7a5\uc560, \uc2dc\uc2a4\ud15c\ub2e4\uc6b4 \ub4f1)\uc5d0 \uc0ac\uc804\ud1b5\uc9c0\uac00 \ubd88\uac00\ub2a5\ud558\uba70 \ud0c0\uc778 (PC\ud1b5\uc2e0\ud68c\uc0ac, \uae30\uac04\ud1b5\uc2e0\uc0ac\uc5c5\uc790 \ub4f1)\uc758 \uace0\uc758, \uacfc\uc2e4\ub85c \uc778\ud55c \uc2dc\uc2a4\ud15c \uc911\ub2e8 \ub4f1\uc758 \uacbd\uc6b0\uc5d0\ub294 \ud1b5\uc9c0\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\n(8) \ud68c\uc0ac\uac00 \uc81c\uacf5\ud558\ub294 \uc11c\ube44\uc2a4\uc758 \ud615\ud0dc\uc640 \uae30\ub2a5, \ub514\uc790\uc778 \ub4f1 \ud544\uc694\ud55c \uacbd\uc6b0 \uc218\uc2dc\ub85c \ubcc0\uacbd\ub418\uac70\ub098, \uc911\ub2e8\ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ud68c\uc0ac\ub294 \uc774 \uacbd\uc6b0 \uac1c\ubcc4\uc801\uc778 \ubcc0\uacbd\uc5d0 \ub300\ud574\uc11c \ud68c\uc6d0\uc5d0\uac8c \uc0ac\uc804 \ud1b5\uc9c0\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \ub2e4\ub9cc, \ud68c\uc6d0\uc5d0\uac8c \ubd88\ub9ac\ud55c \uac83\uc73c\ub85c \ud310\ub2e8\ub418\ub294 \uacbd\uc6b0 \uc774\uba54\uc77c\uc744 \ud1b5\ud558\uc5ec \uc774\ub97c \uacf5\uc9c0\ud569\ub2c8\ub2e4.\n\n\uc81c11\uc870 \uc11c\ube44\uc2a4 \uc774\uc6a9\uc81c\ud55c\n\n(1) \ud68c\uc0ac\ub294 \ud68c\uc6d0\uc774 \ubcf8 \uc57d\uad00 \uc81c18\uc870 \uc774\uc6a9\uc790\uc758 \uc758\ubb34 \ub4f1 \ubcf8 \uc57d\uad00\uc758 \ub0b4\uc6a9\uc5d0 \uc704\ubc30\ub418\ub294 \ud589\ub3d9\uc744 \ud55c \uacbd\uc6b0, \uc784\uc758\ub85c \uc11c\ube44\uc2a4 \uc0ac\uc6a9\uc744 \uc81c\ud55c \ubc0f \uc911\uc9c0\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc774 \uacbd\uc6b0 \ud68c\uc0ac\ub294 \ud68c\uc6d0\uc758 \uc811\uc18d\uc744 \uae08\uc9c0\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n\uc81c12\uc870 \uc815\ubcf4\uc81c\uacf5 \ubc0f \uad11\uace0\uc758 \uac8c\uc7ac\n\n(1) \ud68c\uc0ac\ub294 \ud68c\uc6d0\uc774 \uc11c\ube44\uc2a4 \uc774\uc6a9 \uc911 \ud544\uc694\ud558\ub2e4\uace0 \uc778\uc815\ub418\ub294 \ub2e4\uc591\ud55c \uc815\ubcf4 \ubc0f \uad11\uace0\uc5d0 \ub300\ud574\uc11c\ub294 \uc804\uc790\uc6b0\ud3b8\uc774\ub098 \uc11c\uc2e0\uc6b0\ud3b8, SMS(\ud734\ub300\ud3f0 \ubb38\uc790\uba54\uc2dc\uc9c0), DM(Direct Mail), \uba54\uc2e0\uc800 \ub4f1\uc758 \ubc29\ubc95\uc73c\ub85c \ud68c\uc6d0\uc5d0\uac8c \uc81c\uacf5\ud560 \uc218 \uc788\uc73c\uba70, \ub9cc\uc57d \uc6d0\uce58 \uc54a\ub294 \uc815\ubcf4\ub97c \uc218\uc2e0\ud55c \uacbd\uc6b0 \ud68c\uc6d0\uc740 \uc774\ub97c \uc218\uc2e0\uac70\ubd80 \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n(2) \ud68c\uc0ac\ub294 \uc11c\ube44\uc2a4\uc758 \uc6b4\uc6a9\uacfc \uad00\ub828\ud558\uc5ec \uc11c\ube44\uc2a4\ud654\uba74, \ud648\ud398\uc774\uc9c0, \uc804\uc790\uc6b0\ud3b8 \ub4f1\uc5d0 \uad11\uace0 \ub4f1\uc744 \uac8c\uc7ac\ud560 \uc218 \uc788\uc73c\uba70, \ud68c\uc0ac\ub294 \uc11c\ube44\uc2a4\ub97c \uc774\uc6a9\ud558\uace0\uc790 \ud558\ub294 \ud68c\uc6d0\uc774 \uc774 \uad11\uace0\uac8c\uc7ac\uc5d0 \ub300\ud558\uc5ec \ub3d9\uc758\ud558\ub294 \uac83\uc73c\ub85c \uac04\uc8fc\ud569\ub2c8\ub2e4.\n(3) \ud68c\uc0ac\ub294 \uc11c\ube44\uc2a4 \uc0c1\uc5d0 \uac8c\uc7ac\ub418\uc5b4 \uc788\uac70\ub098 \uc11c\ube44\uc2a4\ub97c \ud1b5\ud55c \uad11\uace0\uc8fc\uc640\uc758 \ud310\ucd09\ud65c\ub3d9\uc5d0 \ud68c\uc6d0\uc774 \ucc38\uc5ec\ud558\uac70\ub098 \uad50\uc2e0 \ub610\ub294 \uac70\ub798\uc758 \uacb0\uacfc\ub85c\uc11c \ubc1c\uc0dd\ud558\ub294 \ubaa8\ub4e0 \uc190\uc2e4 \ub610\ub294 \uc190\ud574\uc5d0 \ub300\ud574 \ucc45\uc784\uc744 \uc9c0\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\n\n\uc81c13\uc870 \uac8c\uc2dc\ubb3c\uc758 \uad00\ub9ac \uc6b4\uc601\n\n(1) \ud68c\uc6d0\uc774 \uc791\uc131\ud55c \uac8c\uc2dc\ubb3c\uc5d0 \ub300\ud55c \ubaa8\ub4e0 \uad8c\ub9ac \ubc0f \ucc45\uc784\uc740 \uc774\ub97c \uac8c\uc2dc\ud55c \ud68c\uc6d0\uc5d0\uac8c \uc788\uc73c\uba70, \ud68c\uc0ac\ub294 \ud68c\uc6d0\uc774 \uac8c\uc2dc\ud558\uac70\ub098 \ub4f1\ub85d\ud558\ub294 \uc11c\ube44\uc2a4\uc758 \ub0b4\uc6a9\ubb3c\uc774 \ub2e4\uc74c \uac01 \ud56d\uc5d0 \ud574\ub2f9\ud55c\ub2e4\uace0 \ud310\ub2e8\ub418\ub294 \uacbd\uc6b0\uc5d0 \uc0ac\uc804\ud1b5\uc9c0 \uc5c6\uc774 \uc0ad\uc81c\ud560 \uc218 \uc788\uace0, \uc774\uc5d0 \ub300\ud558\uc5ec \ud68c\uc0ac\ub294 \uc5b4\ub5a0\ud55c \ucc45\uc784\ub3c4 \uc9c0\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\n- \ubcf8 \uc11c\ube44\uc2a4 \uc57d\uad00\uc5d0 \uc704\ubc30\ub418\uac70\ub098 \uc0c1\uc6a9 \ub610\ub294 \ubd88\ubc95, \uc74c\ub780, \uc800\uc18d\ud558\ub2e4\uace0 \ud310\ub2e8\ub418\ub294 \uac8c\uc2dc\ubb3c\uc744 \uac8c\uc2dc\ud55c \uacbd\uc6b0\n- \ud68c\uc0ac\uc758 \uc6d0\ud65c\ud55c \uc11c\ube44\uc2a4 \uc81c\uacf5\uc744 \ubc29\ud574\ud558\uac70\ub098 \uc11c\ube44\uc2a4 \uc131\uaca9\uc5d0 \ubd80\ud569\ud558\uc9c0 \uc54a\ub294 \uc815\ubcf4\uc758 \uacbd\uc6b0\n- \uacf5\uacf5\uc9c8\uc11c \ubc0f \ubbf8\ud48d\uc591\uc18d\uc5d0 \uc704\ubc18\ub418\ub294 \ub0b4\uc6a9\uc778 \uacbd\uc6b0\n- \ub2e4\ub978 \ud68c\uc6d0 \ub610\ub294 \uc81c 3\uc790\ub97c \ube44\ubc29\ud558\uac70\ub098 \uc911\uc0c1\ubaa8\ub7b5\uc73c\ub85c \uba85\uc608\ub97c \uc190\uc0c1\uc2dc\ud0a4\uace0 \ud53c\ud574\ub97c \uc8fc\ub294 \ub0b4\uc6a9\uc778 \uacbd\uc6b0\n- \ud574\ub2f9 \uc0c1\ud488 \ubc0f \ucf58\ud150\uce20 \ub0b4\uc6a9\uacfc \uad00\ub828 \uc5c6\ub294 \uacbd\uc6b0\n- \uad11\uace0, \ud64d\ubcf4 \ub4f1\uc758 \uc0c1\uc5c5\uc801\uc778 \ub0b4\uc6a9\uc778 \uacbd\uc6b0\n- \ubc94\uc8c4\uc801 \ud589\uc704\uc5d0 \uacb0\ubd80\ub41c\ub2e4\uace0 \uc778\uc815\ub418\ub294 \ub0b4\uc6a9\uc778 \uacbd\uc6b0\n- \uae30\ud0c0 \uad00\uacc4 \ubc95\ub839\uc5d0 \uc704\ubc30\ub418\ub294 \uacbd\uc6b0\n\n(2) \ud68c\uc6d0\uc758 \uac8c\uc2dc\ubb3c\uc774 \ud0c0\uc778\uc758 \uc800\uc791\uad8c\uc744 \uce68\ud574\ud568\uc73c\ub85c\uc368 \ubc1c\uc0dd\ud558\ub294 \ubbfc, \ud615\uc0ac\uc0c1\uc758 \ucc45\uc784\uc740 \uc804\uc801\uc73c\ub85c \ud68c\uc6d0\uc774 \ubd80\ub2f4\ud558\uc5ec\uc57c \ud569\ub2c8\ub2e4.\n\n\uc81c14\uc870 \uad8c\ub9ac\uc758 \uadc0\uc18d \ubc0f \uc800\uc791\ubb3c\uc758 \uc774\uc6a9\n\n(1) \uad6c\ub974\ubc0d \ud50c\ub7ab\ud3fc\uc5d0 \uac1c\uc2dc\ud55c \uc0ac\uc6a9\uc790 \ucf58\ud150\uce20(T-LOG, \uc544\uc774\ud15c \ub4f1)\uc5d0 \ub300\ud55c \ubaa8\ub4e0 \uc800\uc791\uad8c \ubc0f \uae30\ud0c0 \uc9c0\uc801\uc7ac\uc0b0\uad8c\uc740 \ubcf8\uc778\uc5d0\uac8c \uc788\uc2b5\ub2c8\ub2e4. \ub2e4\ub9cc, \uc0ac\uc6a9\uc790 \ucf58\ud150\uce20\ub294 \ud68c\uc0ac\uac00 \uc815\ud55c \uac00\uc774\ub4dc\ub77c\uc778\uc5d0 \uc704\ubc18\ub418\uc9c0 \uc54a\uac8c \uc0ac\uc6a9\ub418\uc5b4\uc57c \ud558\uba70, \ud2b9\ud788 \uc774\ub97c \uad6c\ub974\ubc0d \ud50c\ub7ab\ud3fc \uc678\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 \uacbd\uc6b0\uc5d0\ub294 \ud68c\uc0ac\uc5d0\uc11c \uc815\ud55c \uad6c\ub974\ubc0d \ud65c\uc6a9 \ucf58\ud150\uce20 \uc774\uc6a9 \uac00\uc774\ub4dc\ub77c\uc778\uc744 \uc900\uc218\ud558\uc5ec \uc8fc\uc2dc\uae30 \ubc14\ub78d\ub2c8\ub2e4. \ubcf8 \uc11c\ube44\uc2a4 \uc774\uc6a9\uc73c\ub85c \uc778\ud574 \ubc1c\uc0dd\ud558\ub294 \ubaa8\ub4e0 \ub370\uc774\ud130 \uc0ac\uc6a9\ub8cc\ub294 \uc0ac\uc6a9\uc790\uc758 \ubd80\ub2f4\uc785\ub2c8\ub2e4.\n\n(2) \uc0ac\uc6a9\uc790 \ucf58\ud150\uce20\ub97c \uc11c\ube44\uc2a4\uc5d0 \uac8c\uc2dc\ud568\uc73c\ub85c\uc368 \uc0ac\uc6a9\uc790\ub294 \ud604\uc7ac \ub610\ub294 \ucd94\ud6c4 \uac1c\ubc1c\ub418\ub294 \ubaa8\ub4e0 \ubbf8\ub514\uc5b4 \ubc0f \ubc30\ud3ec \ub9e4\uccb4\uc5d0 \ud574\ub2f9 \uc0ac\uc6a9\uc790 \ucf58\ud150\uce20 \uc0ac\uc6a9 \uad8c\ud55c\uc744 \ud68c\uc0ac\uc5d0 \ubd80\uc5ec\ud55c \uac83\uc73c\ub85c \uac04\uc8fc\ub418\uba70, \ub9c8\ucc2c\uac00\uc9c0\ub85c \ub2e4\ub978 \uc0ac\uc6a9\uc790\uac00 \uc0ac\uc6a9\uc790 \ucf58\ud150\uce20\ub97c \uad6c\ub974\ubc0d \ud50c\ub7ab\ud3fc \ub0b4\ubd80 \ubc0f \uc678\ubd80\uc5d0\uc11c \ud68c\uc0ac\uac00 \uc81c\uacf5\ud558\ub294 \uac00\uc774\ub4dc\ub77c\uc778\uc5d0 \ub530\ub77c \uc0ac\uc6a9\ud558\ub294 \uac83\uc5d0 \ub3d9\uc758\ud55c \uac83\uc73c\ub85c \ubd05\ub2c8\ub2e4.\n\n(3) \uc0ac\uc6a9\uc790\ub294 \uc0ac\uc6a9\uc790 \ucf58\ud150\uce20 \ubc0f \uadf8\ub85c \uc778\ud574 \ubc1c\uc0dd\ud558\ub294 \uc77c\uccb4\uc758 \uc190\ud574\ubc30\uc0c1\uc5d0 \ub300\ud574 \uc804\uc801\uc73c\ub85c \ucc45\uc784\uc744 \ubd80\ub2f4\ud558\uba70, \ud68c\uc0ac\ub294 \uc774\uc5d0 \ub300\ud574 \uc5b4\ub5a0\ud55c \ucc45\uc784\ub3c4 \uc9c0\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \ube44\ub85d \uc758\ubb34\ub294 \uc544\ub2c8\ub098, \ud68c\uc0ac\ub294 \ub3c5\uc790\uc801 \uacb0\uc815\uc5d0 \ub530\ub77c \uc5b8\uc81c\ub4e0\uc9c0 \uc0ac\uc6a9\uc790 \ucf58\ud150\uce20\ub97c \uac80\ud1a0, \uac10\ub3c5 \ubc0f \uc0ad\uc81c\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n(4) \ud68c\uc6d0\uc774 \uc11c\ube44\uc2a4\ub97c \uc774\uc6a9\ud558\ub294 \uacfc\uc815\uc5d0\uc11c \uc791\uc131\ud55c \uac8c\uc2dc\ubb3c(T-LOG), \ub313\uae00 \ub4f1(\uc774\ud558 "\uac8c\uc2dc\ubb3c \ub4f1"\uc774\ub77c \ud569\ub2c8\ub2e4)\uc5d0 \ub300\ud55c \uc9c0\uc801\uc7ac\uc0b0\uad8c\uc744 \ud3ec\ud568\ud55c \uc77c\uccb4\uc758 \uad8c\ub9ac\ub294 \ud68c\uc0ac\uc5d0 \uadc0\uc18d\ub418\uba70, \uc774\ub85c \ubc1c\uc0dd\ud55c 2\ucc28 \ucc3d\uc791\ubb3c(\uc6f9\ud230, \uc6f9\uc18c\uc124, \ub4dc\ub77c\ub9c8 \ub4f1)\uc5d0\uc11c\uc758 \uc218\uc775\uc740 \ud68c\uc0ac 7, \ud68c\uc6d0 3\uc73c\ub85c \ubd84\ubc30\ub429\ub2c8\ub2e4.\n\n(5) \ud68c\uc6d0\uc740 \uc790\uc2e0\uc774 \uc11c\ube44\uc2a4\uc5d0 \uac8c\uc2dc\ud55c \uac8c\uc2dc\ubb3c \ub4f1\uc744 \ud68c\uc0ac\uac00 \uad6d\ub0b4\u318d\uc678\uc5d0\uc11c \ub2e4\uc74c \uac01 \ud638\uc758 \ubaa9\uc801\uc73c\ub85c \uc0ac\uc6a9\ud558\ub294 \uac83\uc744 \ud5c8\ub77d\ud569\ub2c8\ub2e4.\n- \uc11c\ube44\uc2a4(\uc81c3\uc790\uac00 \uc6b4\uc601\ud558\ub294 \uc0ac\uc774\ud2b8 \ub610\ub294 \ubbf8\ub514\uc5b4\uc758 \uc77c\uc815 \uc601\uc5ed \ub0b4\uc5d0 \uc785\uc810\ud558\ub294 \ud615\ud0dc\ub85c \uc81c\uacf5\ub418\ub294 \uacbd\uc6b0 \ud3ec\ud568) \ub0b4\uc5d0\uc11c \uac8c\uc2dc\ubb3c \ub4f1\uc758 \ubcf5\uc81c\xb7\uc804\uc1a1\xb7\uc804\uc2dc \ubc0f \uc6b0\uc218 \uac8c\uc2dc\ubb3c\uc744 \uc11c\ube44\uc2a4 \ud654\uba74\uc5d0 \ub178\ucd9c\ud558\uae30 \uc704\ud558\uc5ec \uac8c\uc2dc\ubb3c\uc758 \ub0b4\uc6a9 \ubcc0\uacbd \uc5c6\uc774 \ud06c\uae30\ub97c \ubcc0\ud658\ud558\uac70\ub098 \ub2e8\uc21c\ud654\ud558\ub294 \ub4f1\uc758 \ubc29\uc2dd\uc73c\ub85c \uc218\uc815\ud558\ub294 \uac83\n- \ud68c\uc0ac\uac00 \uc6b4\uc601\ud558\ub294 \ub2e4\ub978 \uc11c\ube44\uc2a4\uc5d0\uc11c \uac8c\uc2dc\ubb3c\uc744 \ubcf5\uc81c\xb7\uc804\uc1a1 \ub610\ub294 \uc804\uc2dc\ud558\ub294 \uac83.\n- \ud68c\uc0ac\uc758 \uc11c\ube44\uc2a4\ub97c \ud64d\ubcf4\ud558\uae30 \uc704\ud55c \ubaa9\uc801\uc73c\ub85c \ubbf8\ub514\uc5b4\xb7\ud1b5\uc2e0\uc0ac \ub4f1\uc5d0 \uac8c\uc2dc\ubb3c\uc758 \uc804\ubd80 \ub610\ub294 \uc77c\ubd80\ub97c \ubcf4\ub3c4\xb7\ubc29\uc601\ud558\uac8c \ud558\ub294 \uac83. \uc774 \uacbd\uc6b0 \ud68c\uc0ac\ub294 \ud68c\uc6d0\uc758 \uac1c\ubcc4 \ub3d9\uc758 \uc5c6\uc774 \ubbf8\ub514\uc5b4\xb7\ud1b5\uc2e0\uc0ac \ub4f1\uc5d0\uac8c \ud68c\uc6d0\uc815\ubcf4\ub97c \uc81c\uacf5\ud558\uc9c0 \uc54a\uc74c\n(6) \ud68c\uc0ac\ub294 \uc804\ud56d \uc774\uc678\uc758 \ubc29\ubc95\uc73c\ub85c \ud68c\uc6d0\uc758 \uac8c\uc2dc\ubb3c \ub4f1\uc744 \uc774\uc6a9\ud558\uace0\uc790 \ud558\ub294 \uacbd\uc6b0\uc5d0\ub294 \uc0ac\uc804\uc5d0 \ud68c\uc6d0\uc758 \ub3d9\uc758\ub97c \uc5bb\uc2b5\ub2c8\ub2e4.\n(7) \ud68c\uc6d0\uc774 \uc11c\ube44\uc2a4\uc5d0 \uac8c\uc2dc\ubb3c\uc744 \uac8c\uc7ac\ud558\ub294 \uac83\uc740 \ub2e4\ub978 \ud68c\uc6d0\uc774 \uac8c\uc2dc\ubb3c\uc744 \uc11c\ube44\uc2a4 \ub0b4\uc5d0\uc11c \uc0ac\uc6a9\ud558\uac70\ub098 \ud68c\uc0ac\uac00 \uac80\uc0c9\uacb0\uacfc\ub85c \uc0ac\uc6a9\ud558\ub294 \uac83\uc744 \ud5c8\ub77d\ud55c \uac83\uc73c\ub85c \ubd05\ub2c8\ub2e4.\n\n\n\uc81c15\uc870 \uac8c\uc2dc\ubb3c\uc758 \uad00\ub9ac \ubc0f \uc784\uc2dc\uc870\uce58\n\n(1) \ud68c\uc6d0\uc758 \uac8c\uc2dc\ubb3c \ub4f1\uc774 \uad00\ub828 \ubc95\ub839\uc5d0 \uc704\ubc18\ub418\ub294 \ub0b4\uc6a9\uc744 \ud3ec\ud568\ud558\ub294 \uacbd\uc6b0, \ud68c\uc0ac\ub294 \ud574\ub2f9 \uad00\ub828 \ubc95\ub839\uc774\ub098 \uc801\ubc95\ud55c \uad8c\ub9ac\uc790\uc758 \uc694\uccad\uc5d0 \ub530\ub77c \ud574\ub2f9 \uac8c\uc2dc\ubb3c \ub4f1\uc5d0 \ub300\ud55c \uac8c\uc2dc\uc911\ub2e8 \ubc0f \uc0ad\uc81c \ub4f1\uc758 \uc870\uce58\ub97c \ucde8\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n(2) \ud68c\uc0ac\ub294 \uac8c\uc2dc\ubb3c \ub4f1\uc5d0 \ud68c\uc0ac\uc758 \uc11c\ube44\uc2a4 \uc6b4\uc601\uc815\ucc45\uc5d0 \uc704\ubc18\ub418\ub294 \uc0ac\uc720\uac00 \uc788\ub294 \uac83\uc73c\ub85c \ud655\uc778\ub41c \uacbd\uc6b0, \uc6b4\uc601\uc815\ucc45\uc5d0 \ub530\ub77c \ud574\ub2f9 \uac8c\uc2dc\ubb3c\uc5d0 \ub300\ud574 \uc870\uce58\ub97c \ucde8\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n(3) \uc815\ubcf4\ud1b5\uc2e0\ub9dd \uc774\uc6a9\ucd09\uc9c4 \ubc0f \uc815\ubcf4\ubcf4\ud638 \ub4f1\uc5d0 \uad00\ud55c \ubc95\ub960(\uc774\ud558 "\uc815\ubcf4\ud1b5\uc2e0\ub9dd\ubc95")\uc758 \uaddc\uc815\uc5d0 \uc758\ud574 \ub2e4\ub978 \ud68c\uc6d0\uc758 \uacf5\uac1c\ub41c \uac8c\uc2dc\ubb3c \ub4f1\uc774 \ubcf8\uc778\uc758 \uc0ac\uc0dd\ud65c\uc744 \uce68\ud574\ud558\uac70\ub098 \uba85\uc608\ub97c \ud6fc\uc190\ud558\ub294 \ub4f1 \uad8c\ub9ac\ub97c \uce68\ud574 \ubc1b\uc740 \ud68c\uc6d0 \ub610\ub294 \uc81c3\uc790(\uc774\ud558 "\uc0ad\uc81c \ub4f1 \uc2e0\uccad\uc778")\ub294 \uadf8 \uce68\ud574\uc0ac\uc2e4\uc744 \uc18c\uba85\ud558\uc5ec \ud68c\uc0ac\uc5d0 \ud574\ub2f9 \uac8c\uc2dc\ubb3c \ub4f1\uc758 \uc0ad\uc81c \ub610\ub294 \ubc18\ubc15 \ub0b4\uc6a9\uc758 \uac8c\uc7ac\ub97c \uc694\uccad\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc774 \uacbd\uc6b0 \ud68c\uc0ac\ub294 \ud574\ub2f9 \uac8c\uc2dc\ubb3c \ub4f1\uc758 \uad8c\ub9ac \uce68\ud574 \uc5ec\ubd80\ub97c \ud310\ub2e8\ud560 \uc218 \uc5c6\uac70\ub098 \ub2f9\uc0ac\uc790 \uac04\uc758 \ub2e4\ud23c\uc774 \uc608\uc0c1\ub418\ub294 \uacbd\uc6b0 \ud574\ub2f9 \uac8c\uc2dc\ubb3c \ub4f1\uc5d0 \ub300\ud55c \uc811\uadfc\uc744 \uc784\uc2dc\uc801\uc73c\ub85c \ucc28\ub2e8\ud558\ub294 \uc870\uce58(\uc774\ud558 "\uc784\uc2dc\uc870\uce58")\ub97c \ucd5c\uc7a5 30\uc77c\uae4c\uc9c0 \ucde8\ud569\ub2c8\ub2e4.\n\n(4) \uc804\ud56d\uc5d0 \uc758\ud574 \ubcf8\uc778\uc758 \uac8c\uc2dc\ubb3c \ub4f1\uc774 \uc784\uc2dc\uc870\uce58\ub41c \ud68c\uc6d0(\uc774\ud558 "\uac8c\uc2dc\uc790")\uc740 \uc784\uc2dc\uc870\uce58\uae30\uac04 \uc911 \ud68c\uc0ac\uc5d0 \ud574\ub2f9 \uac8c\uc2dc\ubb3c \ub4f1\uc744 \ubcf5\uc6d0\ud574 \uc904 \uac83\uc744 \uc694\uccad(\uc774\ud558 "\uc7ac\uac8c\uc2dc \uccad\uad6c")\ud560 \uc218 \uc788\uc73c\uba70, \ud68c\uc0ac\ub294 \uc784\uc2dc\uc870\uce58\ub41c \uac8c\uc2dc\ubb3c\uc758 \uba85\uc608\ud6fc\uc190 \ub4f1 \ud310\ub2e8\uc5d0 \ub300\ud55c \ubc29\uc1a1\ud1b5\uc2e0\uc2ec\uc758\uc704\uc6d0\ud68c \uc2ec\uc758 \uc694\uccad\uc5d0 \ub300\ud55c \uac8c\uc2dc\uc790 \ubc0f \uc0ad\uc81c \ub4f1 \uc2e0\uccad\uc778\uc758 \ub3d9\uc758\uac00 \uc788\ub294 \uacbd\uc6b0 \uac8c\uc2dc\uc790 \ubc0f \uc0ad\uc81c \ub4f1 \uc2e0\uccad\uc778\uc744 \ub300\ub9ac\ud558\uc5ec \uc774\ub97c \uc694\uccad\ud558\uace0 \ub3d9\uc758\uac00 \uc5c6\ub294 \uacbd\uc6b0 \ud68c\uc0ac\uac00 \uc774\ub97c \ud310\ub2e8\ud558\uc5ec \uac8c\uc2dc\ubb3c \ub4f1\uc758 \ubcf5\uc6d0 \uc5ec\ubd80\ub97c \uacb0\uc815\ud569\ub2c8\ub2e4. \uac8c\uc2dc\uc790\uc758 \uc7ac\uac8c\uc2dc \uccad\uad6c\uac00 \uc788\ub294 \uacbd\uc6b0 \uc784\uc2dc\uc870\uce58 \uae30\uac04 \ub0b4\uc5d0 \ubc29\uc1a1\ud1b5\uc2e0\uc2ec\uc758\uc704\uc6d0\ud68c \ub610\ub294 \ud68c\uc0ac\uc758 \uacb0\uc815\uc774 \uc788\uc73c\uba74 \uadf8 \uacb0\uc815\uc5d0 \ub530\ub974\uace0 \uadf8 \uacb0\uc815\uc774 \uc784\uc2dc\uc870\uce58 \uae30\uac04 \ub0b4\uc5d0 \uc788\uc9c0 \uc54a\ub294 \uacbd\uc6b0 \ud574\ub2f9 \uac8c\uc2dc\ubb3c \ub4f1\uc740 \uc784\uc2dc\uc870\uce58 \ub9cc\ub8cc\uc77c \uc774\ud6c4 \ubcf5\uc6d0\ub429\ub2c8\ub2e4. \uc7ac\uac8c\uc2dc \uccad\uad6c\uac00 \uc5c6\ub294 \uacbd\uc6b0 \ud574\ub2f9 \uac8c\uc2dc\ubb3c \ub4f1\uc740 \uc784\uc2dc\uc870\uce58 \uae30\uac04 \ub9cc\ub8cc \uc774\ud6c4 \uc0ad\uc81c\ub429\ub2c8\ub2e4.\n(5) \ud68c\uc0ac\ub294 \uc11c\ube44\uc2a4 \ub0b4\uc5d0 \uac8c\uc2dc\ub41c \uac8c\uc2dc\ubb3c \ub4f1\uc774 \uc0ac\uc0dd\ud65c \uce68\ud574 \ub610\ub294 \uba85\uc608\ud6fc\uc190 \ub4f1 \uc81c3\uc790\uc758 \uad8c\ub9ac\ub97c \uce68\ud574\ud55c\ub2e4\uace0 \uc778\uc815\ud558\ub294 \uacbd\uc6b0 \ud68c\uc6d0 \ub610\ub294 \uc81c3\uc790\uc758 \uc2e0\uace0\uac00 \uc5c6\ub294 \uacbd\uc6b0\uc5d0\ub3c4 \uc784\uc2dc\uc870\uce58(\uc774\ud558 "\uc784\uc758\uc758 \uc784\uc2dc\uc870\uce58")\ub97c \ucde8\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc784\uc758\uc758 \uc784\uc2dc\uc870\uce58\ub41c \uac8c\uc2dc\ubb3c\uc758 \ucc98\ub9ac \uc808\ucc28\ub294 \ubcf8 \uc870 \uc81c3\ud56d \ud6c4\ub2e8 \ubc0f \uc81c4\ud56d\uc758 \uaddc\uc815\uc5d0 \ub530\ub985\ub2c8\ub2e4.\n(6) \ud68c\uc6d0\uc758 \uac8c\uc2dc\ubb3c \ub4f1\uc73c\ub85c \uc778\ud55c \ubc95\ub960\uc0c1 \uc774\uc775 \uce68\ud574\ub97c \uadfc\uac70\ub85c, \ub2e4\ub978 \ud68c\uc6d0 \ub610\ub294 \uc81c3\uc790\uac00 \ud68c\uc6d0 \ub610\ub294 \ud68c\uc0ac\ub97c \ub300\uc0c1\uc73c\ub85c \ud558\uc5ec \ubbfc\xb7\ud615\uc0ac\uc0c1\uc758 \ubc95\uc801\uc870\uce58(\uc608: \ud615\uc0ac\uace0\uc18c, \uac00\ucc98\ubd84\uc2e0\uccad\u2219\uc190\ud574\ubc30\uc0c1\uccad\uad6c\ub4f1\ubbfc\uc0ac\uc18c\uc1a1\uc758\uc81c\uae30)\ub97c \ucde8\ud558\ub294 \uacbd\uc6b0, \ud68c\uc0ac\ub294 \ub3d9\ubc95\uc801\uc870\uce58\uc758 \uacb0\uacfc\uc778 \ubc95\uc6d0\uc758 \ud655\uc815\ud310\uacb0\uc774 \uc788\uc744 \ub54c \uae4c\uc9c0 \uad00\ub828\uac8c\uc2dc\ubb3c \ub4f1\uc5d0 \ub300\ud55c \uc811\uadfc\uc744 \uc7a0\uc815\uc801\uc73c\ub85c \uc81c\ud55c\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uac8c\uc2dc\ubb3c \ub4f1\uc758 \uc811\uadfc\uc81c\ud55c\uacfc \uad00\ub828\ud55c \ubc95\uc801\uc870\uce58\uc758 \uc18c\uba85, \ubc95\uc6d0\uc758 \ud655\uc815\ud310\uacb0\uc5d0 \ub300\ud55c \uc18c\uba85\ucc45\uc784\uc740 \uac8c\uc2dc\ubb3c \ub4f1\uc5d0 \ub300\ud55c \uc870\uce58\ub97c \uc694\uccad\ud558\ub294\uc790\uac00 \ubd80\ub2f4\ud569\ub2c8\ub2e4.\n\n\uc81c16\uc870 \ud68c\uc0ac\uc758 \uc18c\uc720\uad8c\n\n(1) \ud68c\uc0ac\uac00 \uc81c\uacf5\ud558\ub294 \uc11c\ube44\uc2a4, \uadf8\uc5d0 \ud544\uc694\ud55c \uc18c\ud504\ud2b8\uc6e8\uc5b4, \uc774\ubbf8\uc9c0, \ub9c8\ud06c, \ub85c\uace0, \ub514\uc790\uc778, \uc11c\ube44\uc2a4 \uba85\uce6d, \uc815\ubcf4 \ubc0f \uc0c1\ud45c \ub4f1\uacfc \uad00\ub828\ub41c \uc9c0\uc801\uc7ac\uc0b0\uad8c \ubc0f \uc800\uc791\uad8c, \ud68c\uc6d0 \uac8c\uc2dc\uae00\uc758 2\ucc28 \ucc3d\uc791 \uad8c\ub9ac\ub294 \ud68c\uc0ac\uc5d0\uac8c \uc788\uc2b5\ub2c8\ub2e4.\n(2) \ud68c\uc6d0\uc740 \ud68c\uc0ac\uac00 \uba85\uc2dc\uc801\uc73c\ub85c \uc2b9\uc778\ud55c \uacbd\uc6b0\ub97c \uc81c\uc678\ud558\uace0\ub294 \uc81c1\ud56d \uc18c\uc815\uc758 \uac01 \uc7ac\uc0b0\uc5d0 \ub300\ud55c \uc804\ubd80 \ub610\ub294 \uc77c\ubd80\uc758 \uc218\uc815, \ub300\uc5ec, \ub300\ucd9c, \ud310\ub9e4, \ubc30\ud3ec, \uc81c\uc791, \uc591\ub3c4, \uc7ac\ub77c\uc774\uc13c\uc2a4, \ub2f4\ubcf4\uad8c\uc124\uc815\ud589\uc704, \uc0c1\uc5c5\uc801 \uc774\uc6a9\ud589\uc704\ub97c \ud560 \uc218 \uc5c6\uc73c\uba70, \uc81c3\uc790\ub85c \ud558\uc5ec\uae08 \uc774\uc640 \uac19\uc740 \ud589\uc704\ub97c \ud558\ub3c4\ub85d \ud5c8\ub77d\ud560 \uc218 \uc5c6\uc2b5\ub2c8\ub2e4.\n\n\uc81c17\uc870 \ud68c\uc0ac\uc758 \uc758\ubb34\n\n(1) \ud68c\uc0ac\ub294 \ubc95\ub839\uacfc \ubcf8 \uc57d\uad00\uc774 \uae08\uc9c0\ud558\uac70\ub098 \ubbf8\ud48d\uc591\uc18d\uc5d0 \ubc18\ud558\ub294 \ud589\uc704\ub97c \ud558\uc9c0 \uc54a\uc73c\uba70, \uc9c0\uc18d\uc801 \uc548\uc815\uc801\uc73c\ub85c \uc11c\ube44\uc2a4\ub97c \uc81c\uacf5\ud558\uae30 \uc704\ud558\uc5ec \ub178\ub825\ud560 \uc758\ubb34\uac00 \uc788\uc2b5\ub2c8\ub2e4.\n(2) \ud68c\uc0ac\ub294 \uc774\uc6a9\uc790\uc758 \uac1c\uc778 \uc2e0\uc0c1 \uc815\ubcf4\ub97c \ubcf8\uc778\uc758 \uc2b9\ub099 \uc5c6\uc774 \uc81c3\uc790\uc5d0\uac8c \ub204\uc124, \ubc30\ud3ec\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \ub2e4\ub9cc, \uad00\uacc4\ubc95\ub839\uc5d0 \uc758\ud574 \uad6d\uac00\uae30\uad00\uc758 \uc694\uad6c\ub098 \uc804\uae30\ud1b5\uc2e0\uad00\ub828\ubc95\ub839 \ubc0f \uc815\ubcf4\ud1b5\uc2e0\uc724\ub9ac\uc704\uc6d0\ud68c\uc758 \uc694\uccad \ub4f1 \ubc95\ub960\uc758 \uaddc\uc815\uc5d0 \ub530\ub978 \uc801\ubc95\ud55c \uc808\ucc28\uc5d0 \uc758\ud55c \uacbd\uc6b0\uc5d0\ub294 \uadf8\ub7ec\ud558\uc9c0 \uc544\ub2c8\ud569\ub2c8\ub2e4.\n(3) \ud68c\uc0ac\ub294 \uacc4\uc18d\uc801\uc774\uace0 \uc548\uc815\uc801\uc778 \uc11c\ube44\uc2a4\uc758 \uc81c\uacf5\uc744 \uc704\ud558\uc5ec \uc124\ube44\uc5d0 \uc7a5\uc560\uac00 \uc0dd\uae30\uac70\ub098 \uba78\uc2e4\ub41c \ub54c\uc5d0\ub294 \ubd80\ub4dd\uc774\ud55c \uc0ac\uc720\uac00 \uc5c6\ub294 \ud55c \uc9c0\uccb4\uc5c6\uc774 \uc774\ub97c \uc218\ub9ac \ub610\ub294 \ubcf5\uad6c\ud569\ub2c8\ub2e4.\n(4) \ud68c\uc0ac\uac00 \uc81c\uacf5\ud558\ub294 \uc11c\ube44\uc2a4\ub85c \uc778\ud558\uc5ec \ud68c\uc6d0\uc5d0\uac8c \uc190\ud574\uac00 \ubc1c\uc0dd\ud55c \uacbd\uc6b0 \uadf8\ub7ec\ud55c \uc190\ud574\uac00 \ud68c\uc0ac\uc758 \uace0\uc758\ub098 \uc911\uacfc\uc2e4\uc5d0 \uae30\ud574 \ubc1c\uc0dd\ud55c \uacbd\uc6b0\uc5d0 \ud55c\ud558\uc5ec \ucc45\uc784\uc744 \ubd80\ub2f4\ud558\uba70, \uadf8 \ucc45\uc784\uc758 \ubc94\uc704\ub294 \ud1b5\uc0c1\uc190\ud574\uc5d0 \ud55c\ud569\ub2c8\ub2e4.\n(5) \ud68c\uc0ac\ub294 \ud68c\uc6d0\uc73c\ub85c\ubd80\ud130 \uc81c\uae30\ub418\ub294 \uc758\uacac\uc774\ub098 \ubd88\ub9cc\uc774 \uc815\ub2f9\ud558\ub2e4\uace0 \uc778\uc815\ud560 \uacbd\uc6b0\uc5d0\ub294 \uc2e0\uc18d\ud788 \ucc98\ub9ac\ud558\uc5ec\uc57c \ud569\ub2c8\ub2e4. \ub2e4\ub9cc, \uc2e0\uc18d\ud55c \ucc98\ub9ac\uac00 \uace4\ub780\ud55c \uacbd\uc6b0\uc5d0\ub294 \ud68c\uc6d0\uc5d0\uac8c \uadf8 \uc0ac\uc720\uc640 \ucc98\ub9ac\uc77c\uc815\uc744 \ud1b5\ubcf4\ud558\uc5ec\uc57c \ud569\ub2c8\ub2e4.\n(6) \ud68c\uc0ac\ub294 \uad00\ub828\ubc95\ub839\uc774 \uc815\ud558\ub294 \ubc14\uc5d0 \ub530\ub77c\uc11c \ud68c\uc6d0 \ub4f1\ub85d\uc815\ubcf4\ub97c \ud3ec\ud568\ud55c \ud68c\uc6d0\uc758 \uac1c\uc778\uc815\ubcf4\ub97c \ubcf4\ud638\ud558\uae30 \uc704\ud558\uc5ec \ub178\ub825\ud569\ub2c8\ub2e4. \ud68c\uc6d0\uc758 \uac1c\uc778\uc815\ubcf4\ubcf4\ud638\uc5d0 \uad00\ud574\uc11c\ub294 \uad00\ub828\ubc95\ub839 \ubc0f \uc81c 20\uc870\uc5d0 \uc81c\uc2dc\ub41c \ub0b4\uc6a9\uc744 \uc9c0\ud0b5\ub2c8\ub2e4.\n\n\uc81c18\uc870 \uc774\uc6a9\uc790\uc758 \uc758\ubb34\n\n(1) \ud68c\uc6d0\uc740 \uc11c\ube44\uc2a4 \uc774\uc6a9\uc744 \uc704\ud574 \uac00\uc785\ud560 \uacbd\uc6b0 \ud604\uc7ac\uc758 \uc0ac\uc2e4\uacfc \uc77c\uce58\ud558\ub294 \uc644\uc804\ud55c \uc815\ubcf4 (\uc774\ud558 "\uac00\uc785\uc815\ubcf4")\ub97c \uc81c\uacf5\ud574\uc57c \ud558\uba70, \uac00\uc785\uc815\ubcf4\uac00 \ubcc0\uacbd\ub41c \uacbd\uc6b0 \uc989\uc2dc \uac31\uc2e0\ud574\uc57c \ud569\ub2c8\ub2e4.\n(2) \ud68c\uc6d0\uc740 \ubcf8\uc778\uc758 \uc544\uc774\ub514\uc640 \ube44\ubc00\ubc88\ud638 \uad00\ub9ac\ub97c \uc704\ud574 \uc81c 8 \uc870 \uc774\uc6a9\uc790\uc758 \uc815\ubcf4\ubcf4\uc548 \uc0ac\ud56d\uc744 \uc900\uc218\ud558\uc5ec\uc57c \ud569\ub2c8\ub2e4.\n(3) \ud68c\uc6d0\uc740 \uc11c\ube44\uc2a4\ub97c \uc774\uc6a9 \uc2dc, \uac01 \ud638\uc5d0 \ud574\ub2f9\ud558\ub294 \ud589\uc704\ub97c \ud574\uc11c\ub294 \uc548\ub429\ub2c8\ub2e4.\n- \ud0c0\uc778(\uc18c\uc218\ub97c \ud3ec\ud568)\uc5d0\uac8c \uc704\ud574\ub97c \uac00\ud558\ub294 \ud589\uc704\n- \ud0c0\uc778\uc758 \uc544\uc774\ub514(ID), \ube44\ubc00\ubc88\ud638(PASSWORD) \ub3c4\uc6a9 \ubc0f \ud0c0\uc778\uc73c\ub85c \uac00\uc7a5\ud558\ub294 \ud589\uc704\n- \ud0c0\uc778\uc744 \ube44\ubc29\ud560 \ubaa9\uc801\uc73c\ub85c \uc0ac\uc2e4 \ub610\ub294 \ud5c8\uc704\uc758 \uc0ac\uc2e4\uc744 \uc801\uc2dc\ud558\uc5ec \uba85\uc608\ub97c \ud6fc\uc190\ud558\ub294 \ud589\uc704\n- \uc790\uae30 \ub610\ub294 \ud0c0\uc778\uc5d0\uac8c \uc7ac\uc0b0\uc0c1\uc758 \uc774\uc775\uc744 \uc8fc\uac70\ub098 \ud0c0\uc778\uc5d0\uac8c \uc190\ud574\ub97c \uac00\ud560 \ubaa9\uc801\uc73c\ub85c \ud5c8\uc704\uc758 \uc815\ubcf4\ub97c \uc720\ud1b5\uc2dc\ud0a4\ub294 \ud589\uc704\n- \ud68c\uc0ac\uc758 \uc0ac\uc804 \uc2b9\ub099 \uc5c6\uc774 \uc11c\ube44\uc2a4\ub97c \ud1b5\ud558\uc5ec \uc5bb\uc740 \uc815\ubcf4\ub97c \uac00\uacf5, \ud310\ub9e4\ud558\ub294 \ud589\uc704 \ub4f1 \uc11c\ube44\uc2a4\ub97c \uc774\uc6a9\ud55c \uc601\ub9ac\ud589\uc704\n- \ud0c0\uc778\uc758 \uc815\ubcf4\ud1b5\uc2e0\uc11c\ube44\uc2a4 \uc774\uc6a9\uba85\uc758\ub97c \ub3c4\uc6a9\ud558\uc5ec \uc0ac\uc6a9\ud558\ub294 \ud589\uc704\n- \ubd88\ud544\uc694\ud558\uac70\ub098 \uc2b9\uc778\ub418\uc9c0 \uc54a\uc740 \uad11\uace0, \ud310\ucd09\ubb3c\uc744 \uac8c\uc7ac\ud558\uac70\ub098, \uc800\uc18d \ub610\ub294 \uc74c\ub780\ud55c \ub370\uc774\ud130, \ud14d\uc2a4\ud2b8, \uc18c\ud504\ud2b8\uc6e8\uc5b4, \uc74c\uc545, \uc0ac\uc9c4, \uadf8\ub798\ud53d, \ube44\ub514\uc624 \uba54\uc2dc\uc9c0 \ub4f1\uc744 \uac8c\uc7ac\ud558\uac70\ub098 \uba54\uc2dc\uc9c0 \ub610\ub294 \uc804\uc790\uc6b0\ud3b8\uc73c\ub85c \ubcf4\ub0b4\ub294 \ud589\uc704\n- \uad8c\ub9ac(\uc9c0\uc801\uc7ac\uc0b0\uad8c\uc744 \ud3ec\ud568\ud55c \ubaa8\ub4e0 \uad8c\ub9ac)\uac00 \uc5c6\ub294 \ucf58\ud150\uce20\ub97c \uac8c\uc7ac\ud558\uac70\ub098 \uba54\uc2dc\uc9c0 \ub610\ub294 \uc804\uc790\uc6b0\ud3b8\uc73c\ub85c \ubcf4\ub0b4\ub294 \ud589\uc704\n- \ucef4\ud4e8\ud130 \uc18c\ud504\ud2b8\uc6e8\uc5b4, \ud558\ub4dc\uc6e8\uc5b4, \uc804\uae30\ud1b5\uc2e0 \uc7a5\ube44\ub97c \ud30c\uad34, \ubc29\ud574 \ub610\ub294 \uae30\ub2a5\uc744 \uc81c\ud55c\ud558\uae30 \uc704\ud55c \uc18c\ud504\ud2b8\uc6e8\uc5b4 \ubc14\uc774\ub7ec\uc2a4\ub97c \uac8c\uc7ac\ud558\uac70\ub098 \uba54\uc2dc\uc9c0 \ub610\ub294 \uc804\uc790\uc6b0\ud3b8\uc73c\ub85c \ubcf4\ub0b4\ub294 \ud589\uc704\n- \ub2e4\ub978 \ucef4\ud4e8\ud130 \ucf54\ub4dc, \ud30c\uc77c, \ud504\ub85c\uadf8\ub7a8\uc744 \ud3ec\ud568\ud558\uace0 \uc788\ub294 \uc790\ub8cc\ub97c \uac8c\uc2dc, \uac8c\uc7ac, \uc804\uc790\uc6b0\ud3b8\uc73c\ub85c \ubcf4\ub0b4\ub294 \ud589\uc704 \ub4f1 \ub2e4\ub978 \uc0ac\uc6a9\uc790\uc758 \uac1c\uc778\uc815\ubcf4\ub97c \uc218\uc9d1 \ub610\ub294 \uc800\uc7a5\ud558\ub294 \ud589\uc704\n- \uc7ac\ubb3c\uc744 \uac78\uace0 \ub3c4\ubc15\ud558\uac70\ub098 \uc0ac\ud589\ud589\uc704\ub97c \ud558\ub294 \ud589\uc704\n- \uc724\ub77d\ud589\uc704\ub97c \uc54c\uc120\ud558\uac70\ub098 \uc74c\ud589\uc744 \ub9e4\uac1c\ud558\ub294 \ub0b4\uc6a9\uc758 \uc815\ubcf4\ub97c \uc720\ud1b5\uc2dc\ud0a4\ub294 \ud589\uc704\n- \uae30\ud0c0 \ubd88\ubc95\uc801\uc774\uac70\ub098 \ubd80\ub2f9\ud55c \ud589\uc704\n(4) \ud68c\uc6d0\uc740 \uc774 \uc57d\uad00 \ubc0f \uad00\uacc4\ubc95\ub839\uc5d0\uc11c \uaddc\uc815\ud55c \uc0ac\ud56d\uc744 \uc900\uc218\ud558\uc5ec\uc57c \ud569\ub2c8\ub2e4.\n\n\uc81c19\uc870 \ubd80\uc815\uc774\uc6a9 \uae08\uc9c0\n\n(1) \ud68c\uc0ac\ub294 \ub2e4\uc74c \uac01\ud638\uc5d0 \ud574\ub2f9\ud558\ub294 \uacbd\uc6b0\ub97c \ubd80\uc815 \uc774\uc6a9\ud589\uc704\ub85c \ubd05\ub2c8\ub2e4.\n- \uc790\uc2e0\uc758 ID \uc591\ub3c4 \ub610\ub294 \ud0c0\uc778\uc5d0\uac8c \ud310\ub9e4, \uc138\uacc4\uc640 \uad00\ub828\ub418\uc9c0 \uc54a\uc740 \ubb34\ubd84\ubcc4\ud55c \uc544\uc774\ud15c \uac1c\uc2dc, \uacfc\ub3c4\ud55c \uad11\uace0\uc131 \ucf58\ud150\uce20 \uac1c\uc2dc\n\n- \uc11c\ube44\uc2a4 \uc774\uc6a9 \uc911, \ubcf5\uc81c\ud504\ub85c\uadf8\ub7a8\uc744 \uc2e4\ud589\ud558\uac70\ub098 \ud654\uba74\uc744 \ucea1\uccd0, \ub610\ub294 \ub179\ud654\ub97c \ud558\ub294 \uacbd\uc6b0\n- \ucf58\ud150\uce20\uc758 DRM(Digital Rights Management)\uc744 \ubb34\ub825\ud654\ud558\ub294 \uc77c\uccb4\uc758 \ud589\uc704\n- \uacb0\uc81c\ub97c \ud1b5\ud55c \ud68c\uc0ac\uc640 \ud68c\uc6d0 \uac04\uc758 \uc815\ub2f9\ud55c \uacc4\uc57d\uc774 \uc131\ub9bd\ub418\uc9c0 \uc544\ub2c8\ud55c \uc0c1\ud0dc\uc5d0\uc11c \ucf58\ud150\uce20\ub97c \ubd88\ubc95\uc73c\ub85c \uc0ac\uc6a9\ud558\ub824\ub294 \uc77c\uccb4\uc758 \ud589\uc704\n\n- \ud3ec\uc778\ud2b8 \ub4f1\uc744 \ubd80\ub2f9\ud558\uac8c \ud655\ubcf4\ud560 \ubaa9\uc801\uc73c\ub85c \uc11c\ube44\uc2a4\ub97c \uc774\uc6a9\ud558\ub294 \ud589\uc704\n\n\uc81c20\uc870 \uac1c\uc778\uc815\ubcf4\ubcf4\ud638\uc815\ucc45\n\n(1) \ud68c\uc0ac\ub294 \uc774\uc6a9 \uc2e0\uccad \uc2dc \ud68c\uc6d0\uc774 \uc81c\uacf5\ud558\ub294 \uc815\ubcf4\ub97c \ud1b5\ud558\uc5ec \ud68c\uc6d0\uc5d0 \uad00\ud55c \uc815\ubcf4\ub97c \uc218\uc9d1\ud558\uba70, \ud68c\uc6d0\uc758 \uac1c\uc778\uc815\ubcf4\ub294 \ubcf8 \uc774\uc6a9\uacc4\uc57d\uc758 \uc774\ud589\uacfc \ubcf8 \uc774\uc6a9\uacc4\uc57d\uc0c1\uc758 \uc11c\ube44\uc2a4\uc81c\uacf5\uc744 \uc704\ud55c \ubaa9\uc801\uc73c\ub85c \uc774\uc6a9\ud569\ub2c8\ub2e4.\n(2) \ud68c\uc0ac\ub294 \uc11c\ube44\uc2a4 \uc81c\uacf5\uacfc \uad00\ub828\ud558\uc5ec \ucde8\ub4dd\ud55c \ud68c\uc6d0\uc758 \uc815\ubcf4\ub97c \ubcf8\uc778\uc758 \uc2b9\ub099 \uc5c6\uc774 \uc81c 3\uc790\uc5d0\uac8c \ub204\uc124 \ub610\ub294 \ubc30\ud3ec\ud560 \uc218 \uc5c6\uc73c\uba70 \uc0c1\uc5c5\uc801 \ubaa9\uc801\uc73c\ub85c \uc0ac\uc6a9\ud560 \uc218 \uc5c6\uc2b5\ub2c8\ub2e4. \ub2e4\ub9cc, \ub2e4\uc74c\uc758 \uac01 \ud638\uc758 \uacbd\uc6b0\uc5d0\ub294 \uadf8\ub7ec\ud558\uc9c0 \uc544\ub2c8\ud569\ub2c8\ub2e4.\n- \uad00\uacc4 \ubc95\ub839\uc5d0 \uc758\ud558\uc5ec \uc218\uc0ac\uc0c1\uc758 \ubaa9\uc801\uc73c\ub85c \uad00\uacc4\uae30\uad00\uc73c\ub85c\ubd80\ud130 \uc694\uad6c\uac00 \uc788\ub294 \uacbd\uc6b0\n- \uc815\ubcf4\ud1b5\uc2e0\uc724\ub9ac\uc704\uc6d0\ud68c\uc758 \uc694\uccad\uc774 \uc788\ub294 \uacbd\uc6b0\n- \uae30\ud0c0 \uad00\uacc4\ubc95\ub839\uc5d0\uc11c \uc815\ud55c \uc808\ucc28\uc5d0 \ub530\ub978 \uc694\uccad\uc774 \uc788\ub294 \uacbd\uc6b0\n\n\uc81c21\uc870 \ud68c\uc6d0\uc5d0 \ub300\ud55c \ud1b5\uc9c0\n\n(1) \ud68c\uc0ac\uac00 \ud68c\uc6d0\uc5d0 \ub300\ud55c \ud1b5\uc9c0\ub97c \ud558\ub294 \uacbd\uc6b0, \ud68c\uc6d0\uc774 \ud68c\uc0ac\uc640 \ubbf8\ub9ac \uc57d\uc815\ud558\uc5ec \uc9c0\uc815\ud55c \uc804\uc790\uc6b0\ud3b8 \uc8fc\uc18c, \ud31d\uc5c5, \uc6f9/\uc571 \ud478\uc2dc\uc54c\ub9bc, \uc804\ud654\ub85c \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n(2) \ud68c\uc0ac\ub294 \ubd88\ud2b9\uc815 \ub2e4\uc218 \ud68c\uc6d0\uc5d0 \ub300\ud55c \ud1b5\uc9c0\uc758 \uacbd\uc6b0, 1\uc8fc\uc77c \uc774\uc0c1 \uc0ac\uc774\ud2b8\uc5d0 \uac8c\uc2dc\ud568\uc73c\ub85c\uc368 \uac1c\ubcc4 \ud1b5\uc9c0\uc5d0 \uac08\uc74c\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ub2e4\ub9cc, \ud68c\uc6d0 \ubcf8\uc778\uc758 \uac70\ub798\uc640 \uad00\ub828\ud558\uc5ec \uc911\ub300\ud55c \uc601\ud5a5\uc744 \ubbf8\uce58\ub294 \uc0ac\ud56d\uc5d0 \ub300\ud558\uc5ec\ub294 \uac1c\ubcc4 \ud1b5\uc9c0\ud569\ub2c8\ub2e4.\n\n\uc81c22\uc870 \uac1c\ubcc4 \uc11c\ube44\uc2a4\uc5d0 \ub300\ud55c \uc57d\uad00 \ubc0f \uc774\uc6a9\uc870\uac74\n\n(1) \ud68c\uc0ac\ub294 \uc81c\uacf5\ud558\ub294 \uc11c\ube44\uc2a4\uc758 \uad6c\uccb4\uc801 \ub0b4\uc6a9\uc5d0 \ub530\ub77c \uac1c\ubcc4 \uc11c\ube44\uc2a4\uc5d0 \ub300\ud55c \uc57d\uad00 \ubc0f \uc774\uc6a9\uc870\uac74\uc744 \uac01 \uac1c\ubcc4\uc11c\ube44\uc2a4\ub9c8\ub2e4 \ubcc4\ub3c4\ub85c \uc815\ud558\uc5ec \ud68c\uc6d0\uc758 \ub3d9\uc758\ub97c \uc5bb\uc744 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc774 \uacbd\uc6b0 \uac1c\ubcc4 \uc11c\ube44\uc2a4\uc5d0 \ub300\ud55c \uc774\uc6a9\uc57d\uad00 \ub4f1\uc774 \ubcf8 \uc57d\uad00\uc5d0 \uc6b0\uc120\ud569\ub2c8\ub2e4.\n\n\uc81c23\uc870 \uc8fc\ubb38 \ubc0f \uacb0\uc81c\n\n(1) \ud68c\uc6d0\uc740 \ud68c\uc0ac\uac00 \uc81c\uacf5\ud558\ub294 \ub2e4\uc74c \uac01\ud638 \ub610\ub294 \uc774\uc640 \uc720\uc0ac\ud55c \uc808\ucc28\uc5d0 \uc758\ud558\uc5ec \ucf58\ud150\uce20 \ubc0f \uc7ac\ud654\uc758 \uad6c\ub9e4\ub97c \uc2e0\uccad\uc744 \ud569\ub2c8\ub2e4.\n- \ucf58\ud150\uce20 \uac80\uc0c9, \ubaa9\ub85d \uc5f4\ub78c \ubc0f \uad6c\ub9e4 \ub300\uc0c1 \uc120\ud0dd\n- \ucf58\ud150\uce20\uc758 \uc0c1\uc138\uc815\ubcf4 \ud655\uc778\n- \ud68c\uc6d0\uc758 \uc131\uba85, \uce74\ub4dc\ubc88\ud638 \ub4f1\uc758 \uc785\ub825 \ubc0f \uacb0\uc81c\ud558\uae30 \ud074\ub9ad\n- \uacb0\uc81c\uae08\uc561 \ud655\uc778, \uacb0\uc81c\uc218\ub2e8 \uc120\ud0dd \ubc0f \uacb0\uc81c\ud558\uae30\n- \uacb0\uc81c\uae08\uc561 \uc7ac\ud655\uc778 \ubc0f \uacb0\uc81c\n(2) \ud68c\uc6d0\uc740 \ud68c\uc0ac\uc5d0\uc11c \uc815\ud558\ub294 \ubc29\ubc95\uc73c\ub85c \uc720\ub8cc\uc11c\ube44\uc2a4\uc758 \uacb0\uc81c\uac00 \uac00\ub2a5\ud569\ub2c8\ub2e4.\n\n\uc81c24\uc870 \uacc4\uc57d\uc758 \uc131\ub9bd \ubc0f \ud1b5\uc9c0\n\n(1) \ud68c\uc0ac\ub294 \ub2e4\uc74c \uac01\ud638\uc5d0 \ud574\ub2f9\ud558\uc9c0 \uc54a\ub294 \ud55c \uad6c\ub9e4 \uc2e0\uccad\uc744 \uc2b9\ub099\ud569\ub2c8\ub2e4.\n- \uc2e0\uccad \ub0b4\uc6a9\uc5d0 \ud5c8\uc704, \ub204\ub77d, \uc624\uae30\uac00 \uc788\ub294 \uacbd\uc6b0\n- \ubbf8\uc131\ub144\uc790\uac00 \uccad\uc18c\ub144 \ubcf4\ud638\ubc95\uc5d0\uc11c \uae08\uc9c0\ud558\ub294 \ucf58\ud150\uce20\ub97c \uad6c\ub9e4\ud558\ub294 \uacbd\uc6b0\n- \uc720\ub8cc \uc11c\ube44\uc2a4 \uc2e0\uccad\uae08\uc561 \ucd1d\uc561\uacfc \uc785\uae08\ucd1d\uc561\uc774 \uc77c\uce58\ud558\uc9c0 \uc54a\uc740 \uacbd\uc6b0\n- \uad6c\ub9e4\uc2e0\uccad\uc5d0 \uc2b9\ub099\ud558\ub294 \uac83\uc774 \ud68c\uc0ac\uc758 \uae30\uc220\uc0c1 \ud604\uc800\ud788 \uc9c0\uc7a5\uc774 \uc788\ub2e4\uace0 \ud310\ub2e8\ud558\ub294 \uacbd\uc6b0\n- \uae30\ud0c0 \ud569\ub9ac\uc801\uc778 \uc774\uc720\uac00 \uc788\ub294 \uacbd\uc6b0\ub85c\uc11c \ud68c\uc0ac\uac00 \ud544\uc694\ud558\ub2e4\uace0 \uc778\uc815\ub418\ub294 \uacbd\uc6b0\n(2) \ud68c\uc0ac\ub294 \ud68c\uc6d0\uc774 \ubcf8 \uc57d\uad00 \uc81c22\uc870\uc758 \uc808\ucc28\uc5d0 \ub530\ub77c \uc720\ub8cc\uc11c\ube44\uc2a4 \uc774\uc6a9\uc744 \uc2e0\uccad\ud560 \uacbd\uc6b0, \uc2b9\ub099\uc758 \uc758\uc0ac\ud45c\uc2dc\ub85c\uc368 \ubcf8 \uc57d\uad00 \uc81c21\uc870\uc758 \ubc29\ubc95\uc744 \ud1b5\ud558\uc5ec \ud68c\uc6d0\uc5d0\uac8c \ud1b5\uc9c0\ud558\uace0, \uc2b9\ub099\uc758 \ud1b5\uc9c0\uac00 \ud68c\uc6d0\uc5d0\uac8c \ub3c4\ub2ec\ud55c \uc2dc\uc810\uc5d0 \uacc4\uc57d\uc774 \uc131\ub9bd\ud55c \uac83\uc73c\ub85c \ubd05\ub2c8\ub2e4.\n(3) \ud68c\uc0ac\uc758 \uc2b9\ub099\uc758 \uc758\uc0ac\ud45c\uc2dc\uc5d0\ub294 \ud68c\uc6d0\uc758 \uc774\uc6a9\uc2e0\uccad\uc5d0 \ub300\ud55c \ud655\uc778 \ubc0f \uc11c\ube44\uc2a4\uc81c\uacf5 \uac00\ub2a5\uc5ec\ubd80, \uc774\uc6a9\uc2e0\uccad\uc758 \uc815\uc815, \ucde8\uc18c \ub4f1\uc5d0 \uad00\ud55c \uc815\ubcf4 \ub4f1\uc744 \ud3ec\ud568\ud569\ub2c8\ub2e4.\n\n\uc81c25\uc870 \ucf58\ud150\uce20\uc758 \uacf5\uae09\n\n(1) \ud68c\uc0ac\ub294 \ucf58\ud150\uce20 \ubc0f \uc7ac\ud654\uc758 \uacf5\uae09\uc2dc\uae30\uc5d0 \uad00\ud558\uc5ec \uc774\uc6a9\uc790\uc640 \ub9fa\uc740 \ubcc4\ub3c4\uc758 \uc57d\uc815\uc774 \uc5c6\ub294 \uc774\uc0c1, \uc774\uc6a9\uc790\uc758 \uad6c\ub9e4\uac00 \uc644\ub8cc\ub41c \uc2dc\uc810\uc5d0 \uc989\uc2dc \ucf58\ud150\uce20(T-LOG, \uc544\uc774\ud15c, \uafc8 \ub4f1)\uc744 \uacf5\uae09\ud569\ub2c8\ub2e4.\n(2) \ud68c\uc0ac\ub294 \uc774\uc6a9\uc790\uac00 \uad6c\ub9e4\ud55c \ucf58\ud150\uce20\uc5d0 \ub300\ud55c \uacf5\uae09 \uc808\ucc28 \ubc0f \uc9c4\ud589 \uc0ac\ud56d\uc744 \ud655\uc778\ud560 \uacbd\uc6b0 \ubb38\uc758 \uc0ac\ud56d\uc5d0 \uc2e0\uc18d\ud788 \uc751\ub300\ud569\ub2c8\ub2e4.\n(3) \ud68c\uc0ac\ub294 \uac24\ub7ec\ub9ac\uc5d0\uc11c \ubc1c\uc0dd\ud55c \ud310\ub9e4/\uad6c\ub9e4\uc5d0 \ub300\ud558\uc5ec \uc544\ub798\uc640 \uac19\uc740 \uc808\ucc28\ub97c \ub530\ub985\ub2c8\ub2e4.\n- \uad6c\ub9e4\ud558\ub824\ub294 \uc544\uc774\ud15c \uac80\uc0c9 \ubc0f \uc120\ud0dd\n- \ud310\ub9e4 \uae08\uc561\uacfc \uc77c\uce58\ud558\ub294 \uae08\uc561 \uc785\uae08(\uad6c\ub974\ubc0d \ud3ec\uc778\ud2b8\ub85c)\n- \uc785\uae08\ub41c \uae08\uc561\uc740 \ud310\ub9e4\uc790\uc758 \ud3ec\uc778\ud2b8\ub85c \ubc14\ub85c \ubcc0\ud658\n- \uc785\uae08\ub41c \ud3ec\uc778\ud2b8\ub294 \ud68c\uc6d0\ud65c\ub3d9\uc5d0 \ub530\ub978 \ud3ec\uc778\ud2b8\uc640 \ud568\uaed8 \uacc4\uc0b0\ub418\uc5b4 \uc815\uc0b0 \uc2e0\uccad\uc2dc \uc218\uc218\ub8cc\ub97c \uc81c\uc678\ud55c \ud604\uae08\uc73c\ub85c \uc989\uc2dc \uc785\uae08.\n\n\n\uc81c26\uc870 \uc218\uc218\ub8cc\n\n(1) \ud68c\uc6d0\uc758 \uc571 \uac00\uc785\uc740 \ubb34\ub8cc\uc774\uba70, \ud2b9\uc815 \uc11c\ube44\uc2a4 \uc774\uc6a9 \uc2dc\uc5d0\ub9cc \uc218\uc218\ub8cc\uac00 \ubd80\uacfc\ub429\ub2c8\ub2e4.\n(2) \uc11c\ube44\uc2a4 \uc218\uc218\ub8cc \uc815\ucc45\uc740 \ud68c\uc0ac \uc11c\ube44\uc2a4\uc5d0\uc11c \uc815\uc758\ud55c \uaddc\uce59\uc5d0 \ub530\ub974\uba70, \ud68c\uc6d0\uc740 \uc11c\ube44\uc2a4 \uc774\uc6a9\uc5d0 \ub300\ud55c \uc218\uc218\ub8cc\ub97c \ubd80\ub2f4\ud574\uc57c \ud569\ub2c8\ub2e4.\n(3) \uc11c\ube44\uc2a4 \uc218\uc218\ub8cc \uc815\ucc45\uc740 \ud68c\uc0ac\uc758 \uc0ac\uc815\uc5d0 \ub530\ub77c \ubcc0\uacbd\ub420 \uc218 \uc788\uc73c\uba70, \ud68c\uc0ac\ub294 \uc0ac\uc804\uc5d0 \uc0ac\uc774\ud2b8\ub97c \ud1b5\ud574 \ubcc0\uacbd\ub0b4\uc6a9\uc744 \uace0\uc9c0\ud569\ub2c8\ub2e4.\n(4) \ud68c\uc6d0\uc740 \ud68c\uc0ac\uc758 \uc11c\ube44\uc2a4 \uc218\uc218\ub8cc \uc678\uc5d0 \ud68c\uc6d0\uc758 \uacb0\uc81c\uc218\ub2e8 (\uc2e0\uc6a9\uce74\ub4dc, \ud734\ub300\ud3f0, \uacc4\uc88c\uc774\uccb4 \ub4f1)\uc774\uc6a9\uc5d0 \ub530\ub978 \uc218\uc218\ub8cc\ub97c \ubd80\ub2f4\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n\uc81c28\uc870 \ucde8\uc18c \ubc0f \ud658\ubd88\n\n(1) \ud68c\uc6d0\uc740 \ub2e4\uc74c \uac01 \ud638\uc758 \uc0ac\ud56d\uc5d0 \ub530\ub77c \uc571\uc5d0\uc11c \uad6c\uc785\ud55c \uad6c\ub974\ubc0d\ud3ec\uc778\ud2b8\uc758 \ud658\ubd88 \ub610\ub294 \ubcc0\uacbd\uc744 \uc694\uccad\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ub2e8, \uad6c\ub974\ubc0d\ud3ec\uc778\ud2b8\ub97c \uc0ac\uc6a9\ud574 T-LOG, \uafc8 (\uc774\ud558 \uad6c\ub974\ubc0d \uace0\uc720 \ucf58\ud150\uce20) \ub4f1\uc758 \ucf58\ud150\uce20\ub97c \uc5f4\uc5b4\ubcf4\uc558\ub2e4\uba74 \uc81c\uacf5\ud55c \ucf58\ud150\uce20\ub97c \uc774\ubbf8 \uc774\uc6a9\ud55c \uac83\uc73c\ub85c \uac04\uc8fc\ud558\uc5ec \ud658\ubd88\uc774 \ubd88\uac00\ub2a5\ud569\ub2c8\ub2e4. \ub610\ud55c \uad6c\ub974\ubc0d\ud3ec\uc778\ud2b8\ub97c \uad6c\ub9e4\ud55c\uc9c0 7\uc77c\uc774 \uacbd\uacfc\ud588\uc744 \uacbd\uc6b0\uc5d0\ub3c4 \ud658\ubd88\uc774 \ubd88\uac00\ub2a5\ud569\ub2c8\ub2e4.\n\n(2) \uad6c\ub9e4\ud55c \uad6c\ub974\ubc0d\ud3ec\uc778\ud2b8\ub294 \uad6c\ub974\ubc0d \uace0\uc720 \ucf58\ud150\uce20\ub97c \uc774\uc6a9\ud558\uc9c0 \uc54a\uc740 \uacbd\uc6b0 \uc0ac\uc6a9\ud55c \uad6c\ub974\ubc0d\ud3ec\uc778\ud2b8\ub97c \uc81c\uc678\ud55c \uae08\uc561 \ud658\ubd88\uc774 \uac00\ub2a5\ud569\ub2c8\ub2e4.\n\n(3) \ub2e4\uc74c \uac01 \ud638\uc758 \uacbd\uc6b0\uc5d0\ub294 \uc774\uc6a9\uc790\uac00 \ud658\ubd88\uc744 \uc694\uccad\ud560 \uc218 \uc5c6\uc2b5\ub2c8\ub2e4.\n- \uad6c\ub974\ubc0d \ud3ec\uc778\ud2b8\ub97c \uc0ac\uc6a9\ud574 \uad6c\ub974\ubc0d \uace0\uc720 \ucf58\ud150\uce20\ub97c \uc774\ubbf8 \uc5f4\ub78c\ud588\uc744 \uacbd\uc6b0\n- \uc11c\ube44\uc2a4 \uc5c5\ub370\uc774\ud2b8\ub97c \ud1b5\ud55c \ubb38\uc81c \ud574\uacb0\uc774 \uac00\ub2a5\ud568\uc5d0\ub3c4 \ud68c\uc6d0\uc758 \uc758\uc0ac\ub85c \uc774\ub97c \uac70\ubd80\ud558\uc5ec \uc11c\ube44\uc2a4\ub97c \uc774\uc6a9\ud558\uc9c0 \ubabb\ud558\ub294 \uacbd\uc6b0\n- \ud68c\uc6d0\uc758 \uc2e4\uc218\ub85c \ud574\ub2f9 \uc11c\ube44\uc2a4\ub97c \uc774\uc6a9\ud558\uc9c0 \ubabb\ud558\ub294 \uacbd\uc6b0\n\n(4) \uac1c\ubcc4 \uc11c\ube44\uc2a4\uc758 \uc131\uaca9\uc5d0 \ub530\ub77c \ud68c\uc0ac\ub294 \ubcc4\ub3c4 \uc57d\uad00 \ubc0f \uc774\uc6a9\uc870\uac74\uc5d0 \ub530\ub978 \ucde8\uc18c \ubc0f \ud658\ubd88 \uaddc\uc815\uc744 \uc815\ud560 \uc218 \uc788\uc73c\uba70, \uc774 \uacbd\uc6b0 \uac1c\ubcc4 \uc57d\uad00 \ubc0f \uc774\uc6a9\uc870\uac74 \uc0c1\uc758 \ucde8\uc18c \ubc0f \ud658\ubd88\uaddc\uc815\uc774 \uc6b0\uc120 \uc801\uc6a9\ub429\ub2c8\ub2e4.\n\n(5) \uae30\ud0c0 \ubcf8 \uc57d\uad00 \ubc0f \uc0ac\uc774\ud2b8\uc758 \uc774\uc6a9\uc548\ub0b4\uc5d0 \uaddc\uc815\ub418\uc9c0 \uc54a\uc740 \ucde8\uc18c \ubc0f \ud658\ubd88\uc5d0 \ub300\ud55c \uc0ac\ud56d\uc5d0 \ub300\ud574\uc11c\ub294 \uc18c\ube44\uc790 \ud53c\ud574\ubcf4\uc0c1\uaddc\uc815\uc5d0\uc11c \uc815\ud55c \ubc14\uc5d0 \ub530\ub985\ub2c8\ub2e4.\n\n\uc81c 29\uc870 \uc218\uc775 \uc815\uc0b0\n\n(1) \ud68c\uc6d0\uc774 \uc815\ub2f9\ud55c \ubc29\uc2dd(\uc544\uc774\ud15c \ud310\ub9e4, T-LOG \uc791\uc131 \ub4f1\uc758 \ud65c\ub3d9)\uc73c\ub85c \ud68c\uc0ac\uc758 \uc11c\ube44\uc2a4\ub97c \uc774\uc6a9\ud574 \ud3ec\uc778\ud2b8\ub97c \uc801\ub9bd\ud55c \uacbd\uc6b0, \ud68c\uc0ac \uc6d0\uce59\uc5d0 \ub530\ub77c \ud604\uae08\uc73c\ub85c \uc815\uc0b0 \ubc1b\uc744 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n(2) \uc218\uc775 \uc815\uc0b0 \uc11c\ube44\uc2a4\ub97c \uc774\uc6a9\ud558\uace0\uc790 \ud558\ub294 \ud68c\uc6d0\uc740 \ud68c\uc0ac\uac00 \uc694\uad6c\ud558\ub294 \uac1c\uc778\uc815\ubcf4\ub97c \uc815\ud655\ud558\uac8c \uc81c\uacf5\ud574\uc57c \ud558\uba70, \ud68c\uc0ac\ub294 \uc815\uc0b0 \uc774\ud589 \uacfc\uc815\uc5d0\uc11c \ud544\uc694\ud55c \ud68c\uc6d0\uc758 \uac1c\uc778\uc815\ubcf4\ub97c \ucd94\uac00\uc801\uc73c\ub85c \uc694\uad6c\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc131\uba85, \uacc4\uc88c\ubc88\ud638, \uc740\ud589\uba85, \uc5f0\ub77d\ucc98 \ub4f1 \uc815\uc0b0\uc561 \uc785\uae08\uc5d0 \ud544\uc694\ud55c \uac1c\uc778 \uc815\ubcf4\ub97c \uc798\ubabb \uc804\ub2ec\ud558\uc5ec \uc190\ud574\uac00 \ubc1c\uc0dd\ud55c \uacbd\uc6b0\uc5d0\ub294 \ud68c\uc0ac\uac00 \ucc45\uc784\uc744 \uc9c0\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\n\n(3) \ud3ec\uc778\ud2b8\ub294 \ucd5c\uc18c 500\uc6d0(500\ud1a0\ud070)\ubd80\ud130 \uc815\uc0b0 \uc2e0\uccad\uc774 \uac00\ub2a5\ud569\ub2c8\ub2e4. \ub2e8, \uc815\uc0b0 \uc2e0\uccad\uc774 \uac00\ub2a5\ud55c \ud3ec\uc778\ud2b8\uc758 \uae30\uc900 \uc870\uac74\uc740 \ubcc0\uacbd\ub420 \uc218 \uc788\uc73c\uba70 \uc774 \uacbd\uc6b0 \ud68c\uc0ac\ub294 \uc0ac\uc804\uc5d0 \uace0\uc9c0\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n(4) \ud3ec\uc778\ud2b8\uc758 \uc815\uc0b0 \uc2e0\uccad \uac00\ub2a5 \uae30\uac04\uc740 \ub9e4\uc6d4 1\uc77c~10\uc77c \ub3d9\uc548 \uc6d4 1\ud68c\uc5d0 \ud55c\ud569\ub2c8\ub2e4.\n\n(5) \ud68c\uc0ac\ub294 \uc815\uc0c1\uc801\uc73c\ub85c \uc815\uc0b0 \uc2e0\uccad\uc774 \uc811\uc218\ub41c \ub0b4\uc5ed\uc5d0 \ub300\ud574 \ud574\ub2f9\ub418\ub294 \ud68c\uc6d0\uc5d0\uac8c \uc775\uc6d4 \uc815\uc0b0\ud568\uc744 \uc6d0\uce59\uc73c\ub85c \ud569\ub2c8\ub2e4.\n\ub9e4\ub2ec 10\uc77c \uc804\uae4c\uc9c0 \uc815\uc0b0 \uc2e0\uccad\uc744 \ud55c \uacbd\uc6b0\uc5d0 \ud55c\ud574 \ucd5c\ub300 \uc775\uc6d4 \ub9d0\uc77c\uc5d0 \ucd5c\uc885 \uc815\uc0b0\uae08\uc744 \uc9c0\uae09\ud558\uba70 \ub2e8, \uc815\uc0b0 \uc2e0\uccad \uc870\uac74\uc774 \ubbf8\ube44\ud558\uac70\ub098 \ubd80\uc815\ud55c \ud65c\ub3d9\uc774 \ud655\uc778\ub41c \uacbd\uc6b0 \uc815\uc0b0\uc774 \uc9c0\uc5f0\ub418\uac70\ub098 \ubcf4\ub958, \uac70\uc808\ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n(6) \ud3ec\uc778\ud2b8 \ud604\uae08 \uc815\uc0b0 \uc2dc \ud68c\uc6d0 9 : \ud68c\uc0ac 1\uc758 \ube44\uc728\ub85c \uc815\uc0b0\uae08\uc744 \uc9c0\uae09\ud569\ub2c8\ub2e4.\n\u2013 \ud574\ub2f9 \uc815\uc0b0 \uc6d0\uce59\uc740 \ud68c\uc0ac\uc758 \uc0ac\uc815\uc5d0 \ub530\ub77c \ubcc0\uacbd\ub420 \uc218 \uc788\uc73c\ub098, \uc870\uac74\uc774 \ubcc0\uacbd\ub420 \uacbd\uc6b0 \ubc18\ub4dc\uc2dc \uc0ac\uc804\uc5d0 \uacf5\uc9c0\ud558\uc5ec \ud574\ub2f9\ub418\ub294 \ud68c\uc6d0\ub4e4\uc5d0\uac8c \ucda9\ubd84\ud55c \uc815\ubcf4\ub97c \uc81c\uacf5\ud558\ub294 \uac83\uc744 \uc6b0\uc120\uc73c\ub85c \ud574\uc57c \ud569\ub2c8\ub2e4.\n\u2013 \uc0c1\uae30 \uc6d0\uce59\uc5d0 \uc758\uac70\ud55c \uc815\uc0b0\uc561\uc5d0\uc11c \ud658\uc804\uc218\uc218\ub8cc 300\uc6d0 \uacf5\uc81c \ud6c4 \uc785\uae08\ub429\ub2c8\ub2e4. \ud574\ub2f9 \uc138\uc561\uc740 \uad6d\ub0b4 \uae30\uc900\uc5d0 \ub530\ub978 \uac83\uc73c\ub85c \ud574\uc678 \uc1a1\uae08\uc740 \ubd88\uac00\ud569\ub2c8\ub2e4.\n\n(7) \ud68c\uc6d0\uc774 \uc815\uc0b0 \uc2e0\uccad\ud558\uc9c0 \uc54a\uc740 \ud3ec\uc778\ud2b8\uc740 \uc815\uc0b0\uc774 \uc774\ub8e8\uc5b4\uc9c0\uc9c0 \uc54a\uc73c\uba70, \ucd5c\uc885 \uc815\uc0b0\uae08 \uc9c0\uae09 \uc774\ud6c4\ub77c \ud558\ub354\ub77c\ub3c4 \ubd80\uc815\ud55c \ubc29\ubc95\uc73c\ub85c \ud604\uae08 \uc815\uc0b0 \uc2e0\uccad\uc744 \ud55c \ub0b4\uc5ed \ub4f1\uc774 \ud655\uc778\ub420 \uacbd\uc6b0\uc5d0\ub294 \uc775\uc6d4 \uc815\uc0b0\uae08\uc5d0\uc11c\uc758 \ucc28\uac10 \ub610\ub294 \uc815\uc0b0\uae08 \ud658\uae09 \uc694\uccad, \ud68c\uc6d0 \uc790\uaca9 \ubc15\ud0c8 \ub4f1\uc758 \uc81c\uc7ac\ub97c \ubc1b\uc744 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n(8) \ubbf8\uc131\ub144\uc790 \ud68c\uc6d0\uc774 \ud604\uae08 \uc815\uc0b0 \uc2e0\uccad\uc744 \ud560 \uacbd\uc6b0, \uce5c\uad8c\uc790 \ub4f1 \ubc95\uc815\ub300\ub9ac\uc778\uc758 \ub3d9\uc758\ud558\uc5d0 \uc774\ub8e8\uc5b4\uc838\uc57c \ud558\uba70 \ud68c\uc0ac\uc758 \uc694\uad6c\uc5d0 \ub530\ub77c \ubcf8\uc778\uacfc \ubc95\uc815\ub300\ub9ac\uc778\uc758 \uc2e0\uc6d0 \ub4f1\uc744 \uc785\uc99d\ud560 \uc758\ubb34\uac00 \uc788\uc2b5\ub2c8\ub2e4.\n\ud68c\uc0ac\ub294 \ud574\ub2f9 \uc808\ucc28\uac00 \ubaa8\ub450 \ucda9\uc871\ub420 \ub54c\uae4c\uc9c0 \uc815\uc0b0\uae08 \uc9c0\uae09\uc744 \uc720\ubcf4\ud560 \uc218 \uc788\uc73c\uba70, \ubc95\uc815\ub300\ub9ac\uc778\uc740 \ubcf8\uc778 \ub3d9\uc758 \uc5c6\uc774 \uccb4\uacb0\ub41c \ubbf8\uc131\ub144\uc790\uc758 \uc720\ub8cc\uc11c\ube44\uc2a4 \uc815\uc0b0\uc5d0 \ub300\ud574 \ud68c\uc0ac\uc5d0 \uc694\uccad\ud558\uc5ec \uc815\uc0b0\uae08 \uc9c0\uae09\uc744 \ucca0\ud68c\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n(9) \uc11c\ube44\uc2a4 \uc548 \ud68c\uc6d0\ud65c\ub3d9(T-LOG \uc791\uc131 \ub4f1)\uc73c\ub85c \uc5bb\uc740 \ud3ec\uc778\ud2b8\uc758 \uc720\ud6a8\uae30\uac04\uc740 \uadf8 \uc801\ub9bd\uc77c\ub85c\ubd80\ud130 1\ub144\uc774\uba70, 1\ub144 \ub3d9\uc548 \uc815\uc0b0 \uc694\uccad\uc744 \ud558\uc9c0 \uc54a\uc558\uac70\ub098, \ud68c\uc6d0\ud0c8\ud1f4 \ub4f1\uc758 \uacbd\uc6b0 \uc0ac\uc804\uacf5\uc9c0 \uc5c6\uc774 \ud3ec\uc778\ud2b8\ub294 \uc18c\uba78\ub429\ub2c8\ub2e4. \uc774 \ub54c \ud68c\uc0ac\ub294 \ud68c\uc6d0\uc5d0\uac8c \ud3ec\uc778\ud2b8\uc5d0 \ub300\ud55c \ubcc4\ub3c4\uc758 \ubcf4\uc0c1\uc744 \ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \ub610\ud55c, \ud0c8\ud1f4 \ud6c4 \uc7ac\uac00\uc785\ud558\ub354\ub77c\ub3c4 \uc18c\uba78\ub41c \ud3ec\uc778\ud2b8\ub294 \ubcf5\uad6c\ub418\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\n\n(10) \uc11c\ube44\uc2a4 \uc548 \uc544\uc774\ud15c \ud310\ub9e4\ub85c \uc5bb\uc740 \ud3ec\uc778\ud2b8\uc758 \uc720\ud6a8\uae30\uac04\uc740 \uc874\uc7ac\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \ub2e4\ub9cc \ud68c\uc6d0\ud0c8\ud1f4 \ub4f1\uc758 \uc774\uc720\ub85c \ud3ec\uc778\ud2b8\uac00 \uc18c\uba78\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc774 \ub54c \ud68c\uc0ac\ub294 \ud68c\uc6d0\uc5d0\uac8c \ud3ec\uc778\ud2b8\uc5d0 \ub300\ud55c \ubcc4\ub3c4\uc758 \ubcf4\uc0c1\uc744 \ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\n\n(10) \ud68c\uc6d0\uc758 \uc218\uc775\uc744 \uc5bb\uae30 \uc704\ud55c \ud68c\uc0ac\uc758 \uc6b4\uc601\ubc29\uce68\uc5d0 \uc5b4\uae0b\ub098\ub294 \ud589\uc704(\uad11\uace0\uc131 \uc138\uacc4 \ub3c4\ubc30, \ubb34\ubd84\ubcc4\ud55c T-LOG \ub3c4\ubc30 \ub4f1)\uac00 \uc801\ubc1c\ub420 \uacbd\uc6b0, \ubcc4\ub3c4\uc758 \uc548\ub0b4 \uc5c6\uc774 \uc601\uad6c\uc801 \ud68c\uc6d0\ud0c8\ud1f4 \ubc0f \ud3ec\uc778\ud2b8 \ud68c\uc218 \uc870\uce58\ub97c \ucde8\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n\n\uc81c33\uc870 \ud68c\uc6d0\ud0c8\ud1f4 \ubc0f \uc790\uaca9\uc0c1\uc2e4\n\n(1) \ud68c\uc6d0\uc740 \ud68c\uc0ac\uc5d0 \uc5b8\uc81c\ub4e0\uc9c0 \ud68c\uc6d0\ud0c8\ud1f4\ub97c \uc694\uccad\ud560 \uc218 \uc788\uc73c\uba70, \ud68c\uc0ac\ub294 \ud68c\uc6d0\ud0c8\ud1f4\uc5d0 \uad00\ud55c \uaddc\uc815\uc5d0 \ub530\ub77c \uc774\ub97c \ucc98\ub9ac\ud569\ub2c8\ub2e4.\n(2) \ud68c\uc0ac\ub294 \ud68c\uc6d0\uc774 \ub2e4\uc74c \uac01 \ud638\uc758 \uc0ac\uc720\uc5d0 \ud574\ub2f9\ud558\ub294 \uacbd\uc6b0, \uc0ac\uc804\ud1b5\uc9c0 \uc5c6\uc774 \ud68c\uc6d0\uc790\uaca9\uc744 \uc81c\ud55c \ubc0f \uc815\uc9c0\uc2dc\ud0ac \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n- \uac00\uc785\uc2e0\uccad \uc2dc\uc5d0 \ud5c8\uc704 \ub0b4\uc6a9\uc744 \ub4f1\ub85d\ud55c \uacbd\uc6b0\n- \uc0ac\uc774\ud2b8\ub97c \uc774\uc6a9\ud558\uc5ec \uacb0\uc81c\ud55c \ub300\uae08, \uae30\ud0c0 \ud68c\uc0ac \uc774\uc6a9\uc5d0 \uad00\ub828\ud558\uc5ec \ud68c\uc6d0\uc774 \ubd80\ub2f4\ud558\ub294 \ucc44\ubb34\ub97c \uae30\uc77c\uc5d0 \uc774\ud589\ud558\uc9c0 \uc54a\ub294 \uacbd\uc6b0\n- \ub2e4\ub978 \uc0ac\ub78c\uc758 \uc11c\ube44\uc2a4 \uc774\uc6a9\uc744 \ubc29\ud574\ud558\uac70\ub098 \uadf8 \uc815\ubcf4\ub97c \ub3c4\uc6a9\ud558\ub294 \ub4f1 \uc804\uc790\uac70\ub798\uc9c8\uc11c\ub97c \uc704\ud611\ud558\ub294 \uacbd\uc6b0\n- \ud68c\uc0ac\ub97c \uc774\uc6a9\ud558\uc5ec \ubc95\ub839\uacfc \uc774 \uc57d\uad00\uc774 \uae08\uc9c0\ud558\uac70\ub098 \uacf5\uacf5\uc9c8\uc11c \ubbf8\ud48d\uc591\uc18d\uc5d0 \ubc18\ud558\ub294 \ud589\uc704\ub97c \ud558\ub294 \uacbd\uc6b0\n(3) \ud68c\uc0ac\uac00 \ud68c\uc6d0\uc790\uaca9\uc744 \uc81c\ud55c, \uc815\uc9c0\uc2dc\ud0a8 \ud6c4 \ub3d9\uc77c\ud55c \ud589\uc704\uac00 2\ud68c \uc774\uc0c1 \ubc18\ubcf5\ub418\uac70\ub098 30\uc77c \uc774\ub0b4\uc5d0 \uadf8 \uc0ac\uc720\uac00 \uc2dc\uc815\ub418\uc9c0 \uc544\ub2c8\ud558\ub294 \uacbd\uc6b0 \ud68c\uc0ac\ub294 \ud68c\uc6d0\uc790\uaca9\uc744 \uc0c1\uc2e4\uc2dc\ud0ac \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n(4) \ud68c\uc0ac\uac00 \ud68c\uc6d0\uc790\uaca9\uc744 \uc0c1\uc2e4\uc2dc\ud0a4\ub294 \uacbd\uc6b0\uc5d0\ub294 \ud68c\uc6d0\ub4f1\ub85d\uc744 \ub9d0\uc18c\ud569\ub2c8\ub2e4. \uc774 \uacbd\uc6b0 \ud68c\uc6d0\uc5d0\uac8c \uc774\ub97c \ud1b5\uc9c0\ud558\uace0, \ud68c\uc6d0\ub4f1\ub85d \ub9d0\uc18c \uc804\uc5d0 \uc18c\uba85\ud560 \uae30\ud68c\ub97c \ubd80\uc5ec\ud569\ub2c8\ub2e4.\n(5) \ud68c\uc0ac\ub294 \ud68c\uc6d0\uc774 \uc774 \uc57d\uad00\uc758 \ub0b4\uc6a9\uc5d0 \uc704\ubc30\ub418\ub294 \ud589\ub3d9\uc744 \ud55c \uacbd\uc6b0, \uc784\uc758\ub85c \uc11c\ube44\uc2a4 \uc0ac\uc6a9\uc744 \uc81c\ud55c \ubc0f \uc911\uc9c0\ud558\uac70\ub098 \ubcf8\uc778\uc758 \ub3d9\uc758 \uc5c6\uc774 \uc774\uc6a9\uacc4\uc57d\uc744 \ud574\uc9c0\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc774 \uacbd\uc6b0 \ud68c\uc0ac\ub294 \ud68c\uc6d0\uc758 \uc811\uc18d\uc744 \uae08\uc9c0\ud560 \uc218 \uc788\uc73c\uba70, \ud68c\uc6d0\uc774 \uac8c\uc2dc\ud55c \ub0b4\uc6a9\uc758 \uc804\ubd80 \ub610\ub294 \uc77c\ubd80\ub97c \uc784\uc758\ub85c \uc0ad\uc81c \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n\uc81c34\uc870 \uc591\ub3c4\uae08\uc9c0\n\n(1) \ud68c\uc6d0\uc740 \uc11c\ube44\uc2a4\uc758 \uc774\uc6a9\uad8c\ud55c, \uae30\ud0c0 \uc774\uc6a9\uacc4\uc57d\uc0c1\uc758 \uc9c0\uc704\ub97c \ud0c0\uc778\uc5d0\uac8c \uc591\ub3c4 \ubc0f \uc99d\uc5ec\ud560 \uc218 \uc5c6\uc73c\uba70, \uc774\ub97c \ub2f4\ubcf4\ub85c \uc81c\uacf5\ud560 \uc218 \uc5c6\uc2b5\ub2c8\ub2e4.\n\n\uc81c35\uc870 \uc190\ud574\ubc30\uc0c1\n\n(1) \ud68c\uc0ac\ub294 \ubb34\ub8cc\ub85c \uc81c\uacf5\ub418\ub294 \uc11c\ube44\uc2a4\uc640 \uad00\ub828\ud558\uc5ec \ud68c\uc6d0\uc5d0\uac8c \uc5b4\ub5a0\ud55c \uc190\ud574\uac00 \ubc1c\uc0dd\ud558\ub354\ub77c\ub3c4 \ud68c\uc0ac\uac00 \uace0\uc758\ub85c \ud589\ud55c \ubc94\uc8c4\ud589\uc704\ub97c \uc81c\uc678\ud558\uace0 \uc774\uc5d0 \ub300\ud558\uc5ec \ucc45\uc784\uc744 \ubd80\ub2f4\ud558\uc9c0 \uc544\ub2c8\ud569\ub2c8\ub2e4.\n\n\uc81c36\uc870 \uba74\ucc45\uc870\ud56d\n\n(1) \ud68c\uc0ac\ub294 \ucc9c\uc7ac\uc9c0\ubcc0, \uc804\uc7c1 \ubc0f \uae30\ud0c0 \uc774\uc5d0 \uc900\ud558\ub294 \ubd88\uac00\ud56d\ub825\uc73c\ub85c \uc778\ud558\uc5ec \uc11c\ube44\uc2a4\ub97c \uc81c\uacf5\ud560 \uc218 \uc5c6\ub294 \uacbd\uc6b0\uc5d0\ub294 \uc11c\ube44\uc2a4 \uc81c\uacf5\uc5d0 \ub300\ud55c \ucc45\uc784\uc774 \uba74\uc81c\ub429\ub2c8\ub2e4.\n(2) \ud68c\uc0ac\ub294 \uae30\uac04\ud1b5\uc2e0 \uc0ac\uc5c5\uc790\uac00 \uc804\uae30\ud1b5\uc2e0 \uc11c\ube44\uc2a4\ub97c \uc911\uc9c0\ud558\uac70\ub098 \uc815\uc0c1\uc801\uc73c\ub85c \uc81c\uacf5\ud558\uc9c0 \uc544\ub2c8\ud558\uc5ec \uc190\ud574\uac00 \ubc1c\uc0dd\ud55c \uacbd\uc6b0 \ucc45\uc784\uc774 \uba74\uc81c\ub429\ub2c8\ub2e4.\n(3) \ud68c\uc0ac\ub294 \uc11c\ube44\uc2a4\uc6a9 \uc124\ube44\uc758 \ubcf4\uc218, \uad50\uccb4, \uc815\uae30\uc810\uac80, \uacf5\uc0ac \ub4f1 \ubd80\ub4dd\uc774\ud55c \uc0ac\uc720\ub85c \ubc1c\uc0dd\ud55c \uc190\ud574\uc5d0 \ub300\ud55c \ucc45\uc784\uc774 \uba74\uc81c\ub429\ub2c8\ub2e4.\n(4) \ud68c\uc0ac\ub294 \uc774\uc6a9\uc790\uc758 \ucef4\ud4e8\ud130 \uc624\ub958\uc5d0 \uc758\ud574 \uc190\ud574\uac00 \ubc1c\uc0dd\ud55c \uacbd\uc6b0, \ub610\ub294 \ud68c\uc6d0\uc774 \uc2e0\uc0c1\uc815\ubcf4 \ubc0f \uc804\uc790\uc6b0\ud3b8 \uc8fc\uc18c\ub97c \ubd80\uc2e4\ud558\uac8c \uae30\uc7ac\ud558\uc5ec \uc190\ud574\uac00 \ubc1c\uc0dd\ud55c \uacbd\uc6b0 \ucc45\uc784\uc744 \uc9c0\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\n(5) \ud68c\uc0ac\ub294 \ud68c\uc6d0\uc774\ub098 \uc81c3\uc790\uc5d0 \uc758\ud574 \ud45c\ucd9c\ub41c \uc5b4\ub5a0\ud55c \uc758\uacac\uc774\ub098 \uc815\ubcf4\uc5d0 \ub300\ud574 \ud655\uc2e0\uc774\ub098 \ub300\ud45c\ud560 \uc758\ubb34\uac00 \uc5c6\uc73c\uba70 \uc758\uacac\uc744 \uc2b9\uc778\ud558\uac70\ub098 \ubc18\ub300\ud558\uac70\ub098 \uc218\uc815\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \ud68c\uc0ac\ub294 \uc5b4\ub5a0\ud55c \uacbd\uc6b0\ub77c\ub3c4 \ud68c\uc6d0\uc774 \uc11c\ube44\uc2a4\uc5d0 \ub2f4\uae34 \uc815\ubcf4\uc5d0 \uc758\uc874\ud574 \uc5bb\uc740 \uc774\ub4dd\uc774\ub098 \uc785\uc740 \uc190\ud574\uc5d0 \ub300\ud574 \ucc45\uc784\uc774 \uc5c6\uc2b5\ub2c8\ub2e4.\n(6) \ud68c\uc0ac\ub294 \ud68c\uc6d0\uac04 \ub610\ub294 \ud68c\uc6d0\uacfc \uc81c3\uc790\uac04\uc5d0 \uc11c\ube44\uc2a4\ub97c \ub9e4\uac1c\ub85c \ud558\uc5ec \ubb3c\ud488\uac70\ub798 \ud639\uc740 \uae08\uc804\uc801 \uac70\ub798 \ub4f1\uacfc \uad00\ub828\ud558\uc5ec \uc5b4\ub5a0\ud55c \ucc45\uc784\ub3c4 \ubd80\ub2f4\ud558\uc9c0 \uc544\ub2c8\ud558\uace0, \ud68c\uc6d0\uc774 \uc11c\ube44\uc2a4\uc758 \uc774\uc6a9\uacfc \uad00\ub828\ud558\uc5ec \uae30\ub300\ud558\ub294 \uc774\uc775\uc5d0 \uad00\ud558\uc5ec \ucc45\uc784\uc744 \ubd80\ub2f4\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\n(7) \ud68c\uc0ac\ub294 \uc774\uc6a9\uc790 \ub610\ub294 \uae30\ud0c0 \uc720\uad00\uae30\uad00\uc774 \uc11c\ube44\uc2a4\uc5d0 \uac8c\uc7ac\ud55c \uc815\ubcf4\uc5d0 \ub300\ud574 \uc815\ud655\uc131, \uc2e0\ub8b0\ub3c4\uc5d0 \ub300\ud558\uc5ec \ubcf4\uc7a5\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \ub530\ub77c\uc11c \ud68c\uc0ac\ub294 \uc774\uc6a9\uc790\uac00 \uc704 \ub0b4\uc6a9\uc744 \uc774\uc6a9\ud568\uc73c\ub85c \uc778\ud574 \uc785\uac8c \ub41c \ubaa8\ub4e0 \uc885\ub958\uc758 \uc190\uc2e4\uc774\ub098 \uc190\ud574\uc5d0 \ub300\ud558\uc5ec \ucc45\uc784\uc744 \ubd80\ub2f4\ud558\uc9c0 \uc544\ub2c8\ud569\ub2c8\ub2e4.\n(8) \ud68c\uc0ac\ub294 \uc774\uc6a9\uc790\uac00 \uc11c\ube44\uc2a4 \uc774\uc6a9\uacfc \uad00\ub828\ud558\uc5ec \uac00\uc785\uc790\uc5d0\uac8c \ubc1c\uc0dd\ud55c \uc190\ud574 \uc911 \uac00\uc785\uc790\uc758 \uace0\uc758, \uacfc\uc2e4\uc5d0 \uc758\ud55c \uc190\ud574 \ubc0f \ud0c0 \uc774\uc6a9\uc790\ub85c \uc778\ud574 \uc785\uac8c \ub418\ub294 \uc815\uc2e0\uc801 \ud53c\ud574\uc5d0 \ub300\ud558\uc5ec \ubcf4\uc0c1\ud560 \ucc45\uc784\uc744 \uc9c0\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\n\n\uc81c37\uc870 \ubd84\uc7c1\ud574\uacb0\n\n(1) \ud68c\uc0ac\ub294 \uc774\uc6a9\uc790\uac00 \uc81c\uae30\ud558\ub294 \uc815\ub2f9\ud55c \uc758\uacac\uc774\ub098 \ubd88\ub9cc\uc744 \ubc18\uc601\ud558\uace0 \uadf8 \ud53c\ud574\ub97c \ubcf4\uc0c1\ucc98\ub9ac\ud558\uae30 \uc704\ud574\uc11c \ud53c\ud574\ubcf4\uc0c1\ucc98\ub9ac \uae30\uad6c\ub97c \uc124\uce58, \uc6b4\uc601\ud569\ub2c8\ub2e4.\n(2) \ud68c\uc0ac\ub294 \uc774\uc6a9\uc790\ub85c\ubd80\ud130 \uc81c\ucd9c\ub418\ub294 \ubd88\ub9cc\uc0ac\ud56d \ubc0f \uc758\uacac\uc740 \uc6b0\uc120\uc801\uc73c\ub85c \uadf8 \uc0ac\ud56d\uc744 \ucc98\ub9ac\ud569\ub2c8\ub2e4. \ub2e4\ub9cc \uc2e0\uc18d\ud55c \ucc98\ub9ac\uac00 \uace4\ub780\ud55c \uacbd\uc6b0\uc5d0\ub294 \uc774\uc6a9\uc790\uc5d0\uac8c \uadf8 \uc0ac\uc720\uc640 \ucc98\ub9ac\uc77c\uc815\uc744 \uc989\uc2dc \ud1b5\ubcf4\ud569\ub2c8\ub2e4.\n\n\uc81c38\uc870 \uc900\uac70\ubc95 \ubc0f \uad00\ud560\ubc95\uc6d0\n\n(1) \uc774 \uc57d\uad00\uc758 \ud574\uc11d \ubc0f \ud68c\uc6d0\uac04\uc758 \ubd84\uc7c1\uc5d0 \ub300\ud558\uc5ec\ub294 \ub300\ud55c\ubbfc\uad6d\uc758 \ubc95\uc744 \uc801\uc6a9\ud569\ub2c8\ub2e4.\n(2) \uc11c\ube44\uc2a4 \uc774\uc6a9 \uc911 \ubc1c\uc0dd\ud55c \ud68c\uc6d0\uacfc \ud68c\uc0ac\uac04\uc758 \uc18c\uc1a1\uc740 \uc11c\uc6b8\uc911\uc559\uc9c0\ubc29\ubc95\uc6d0\uc5d0 \uc81c\uc18c\ud569\ub2c8\ub2e4.\n\n\ubd80\uce59\n\n(1) \uc774 \uc57d\uad00\uc740 2022\ub144 7\uc6d4 8\uc77c\ubd80\ud130 \uc801\uc6a9\ud569\ub2c8\ub2e4.\n\n\n\n\n\n\xa9\ubaa8\ub4e0 \uc800\uc791\uad8c \ubc0f \uc9c0\uc801\uc7ac\uc0b0\uad8c\uc740 \ub098\ucef4\ud37c\ub2c8\uac00 \ubcf4\uc720\ud558\uace0 \uc788\uc73c\uba70, \ucf58\ud150\uce20\uc758 \ud3b8\uc9d1 \ubc0f 2\ucc28 \ucc3d\uc791\uad8c \ub610\ud55c \ub098\ucef4\ud37c\ub2c8 \uc18c\uc720\uc785\ub2c8\ub2e4.\n\n\ubc1c\ud589\uc77c : 2022.07.08\n',null,null,null,null,null,null,null,null,null)
